	VALUES (157, 559, TIMESTAMP WITH TIME ZONE '2019-01-18 16:45:59+00', 'O favor com que mais se acende o engenho
');

	VALUES (158, 340, TIMESTAMP WITH TIME ZONE '2019-05-21 10:29:05+00', 'Depois de ter pisada longamente
');

