	VALUES (192, 196, TIMESTAMP WITH TIME ZONE '2020-11-23 02:51:40+00', '--"Não cometera o moço miserando
');
	VALUES (192, 196, TIMESTAMP WITH TIME ZONE '2020-11-23 10:28:41+00', 'Que o mundo encobre aos homens imprudentes.
');
	VALUES (192, 415, TIMESTAMP WITH TIME ZONE '2020-11-23 16:30:07+00', 'Nascemos: o pesar terá firmeza,
');

	VALUES (193, 553, TIMESTAMP WITH TIME ZONE '2020-10-30 07:38:56+00', 'Já contra mil Romanos pelejaram,
');
	VALUES (193, 553, TIMESTAMP WITH TIME ZONE '2020-10-30 12:39:43+00', 'Que eu vos prometo, filha, que vejais
');

	VALUES (194, 197, TIMESTAMP WITH TIME ZONE '2021-01-25 09:39:47+00', 'A qual se o Céu me dá que eu sem perigo
');
	VALUES (194, 197, TIMESTAMP WITH TIME ZONE '2021-01-25 11:08:46+00', 'As honras imortais e graus maiores:
');
	VALUES (194, 248, TIMESTAMP WITH TIME ZONE '2021-01-25 12:27:41+00', 'O padre Baco ali não consentia
');

	VALUES (195, 593, TIMESTAMP WITH TIME ZONE '2018-09-24 02:02:51+00', 'Pelas lisas colunas lhe trepavam
');
	VALUES (195, 593, TIMESTAMP WITH TIME ZONE '2018-09-24 06:06:16+00', 'Altos varões que estão por vir ao mundo,
');
	VALUES (195, 593, TIMESTAMP WITH TIME ZONE '2018-09-24 07:37:29+00', 'E depois que ao Rei apresentaram,
');

	VALUES (196, 619, TIMESTAMP WITH TIME ZONE '2019-03-30 18:27:07+00', 'Imos buscando as terras apartadas
');
	VALUES (196, 619, TIMESTAMP WITH TIME ZONE '2019-03-31 02:28:48+00', 'Era esta grão vitória, o Rei subido
');

	VALUES (197, 597, TIMESTAMP WITH TIME ZONE '2018-12-26 06:36:18+00', 'Por tão longos trabalhos e acidentes,
');
	VALUES (197, 199, TIMESTAMP WITH TIME ZONE '2018-12-26 10:45:05+00', 'Toma sem tento as armas mui depressa;
');

	VALUES (198, 200, TIMESTAMP WITH TIME ZONE '2019-01-24 20:04:34+00', 'Apolo, e as Musas que me acompanharam,
');

	VALUES (199, 200, TIMESTAMP WITH TIME ZONE '2019-12-21 03:42:24+00', 'Que, crendo ter nos braços quem amava,
');

	VALUES (200, 201, TIMESTAMP WITH TIME ZONE '2019-09-12 22:33:06+00', 'Vê-lo rega, gerando o crocodilo,
');
	VALUES (200, 329, TIMESTAMP WITH TIME ZONE '2019-09-13 02:51:08+00', 'Já no batel entrou do Capitão
');

	VALUES (201, 201, TIMESTAMP WITH TIME ZONE '2019-04-06 16:55:18+00', 'O grã ferreiro sórdido, que obrou
');

	VALUES (202, 202, TIMESTAMP WITH TIME ZONE '2020-10-04 16:42:42+00', '"Parece que guardava o claro Céu
');
	VALUES (202, 202, TIMESTAMP WITH TIME ZONE '2020-10-04 18:22:23+00', 'Dum Lusitano um feito inda vejais,
');

	VALUES (203, 202, TIMESTAMP WITH TIME ZONE '2021-03-23 21:19:48+00', 'Saberá, se mais tempo ali o detinha.
');
	VALUES (203, 519, TIMESTAMP WITH TIME ZONE '2021-03-24 03:23:13+00', 'Príncipe em Guimarães está cercado
');

	VALUES (204, 203, TIMESTAMP WITH TIME ZONE '2020-04-08 01:23:47+00', 'Lá no seio Eritreu, onde fundada
');

	VALUES (205, 203, TIMESTAMP WITH TIME ZONE '2021-02-19 09:33:37+00', '"A nobre ilha também de Taprobana,
');
	VALUES (205, 203, TIMESTAMP WITH TIME ZONE '2021-02-19 16:01:50+00', 'Executa o dinheiro seus poderes.
');
	VALUES (205, 203, TIMESTAMP WITH TIME ZONE '2021-02-19 16:25:35+00', 'Das que nós povoamos, a primeira,
');
	VALUES (205, 648, TIMESTAMP WITH TIME ZONE '2021-02-19 21:21:12+00', 'Que lhe não for agora obediente.
');

	VALUES (206, 210, TIMESTAMP WITH TIME ZONE '2021-05-21 23:17:21+00', 'Que se aqueixa e se ri num mesmo instante,
');
	VALUES (206, 210, TIMESTAMP WITH TIME ZONE '2021-05-22 01:27:43+00', 'Os presos que as desculpas, e tornando
');

	VALUES (207, 205, TIMESTAMP WITH TIME ZONE '2021-03-05 07:16:49+00', 'Que se espalhe e se cante no universo,
');
	VALUES (207, 205, TIMESTAMP WITH TIME ZONE '2021-03-05 09:57:49+00', 'Do Olimpo desce enfim desesperado;
');
	VALUES (207, 205, TIMESTAMP WITH TIME ZONE '2021-03-05 15:34:06+00', 'Que mil vezes dizendo suspirava,
');

	VALUES (208, 314, TIMESTAMP WITH TIME ZONE '2021-03-30 00:25:30+00', 'Muitas vezes as naus que longe estavam
');
	VALUES (208, 205, TIMESTAMP WITH TIME ZONE '2021-03-30 05:54:51+00', 'Alguns tempos esteve incerta dela.
');
	VALUES (208, 205, TIMESTAMP WITH TIME ZONE '2021-03-30 12:23:28+00', 'Aqui gentes estranhas lava e rega
');

	VALUES (209, 340, TIMESTAMP WITH TIME ZONE '2020-09-29 05:28:48+00', 'De Sintra, e nela os olhos se alongavam.
');

	VALUES (210, 206, TIMESTAMP WITH TIME ZONE '2020-09-11 01:51:34+00', 'Os inimigos rompendo, o alferes mata
');

	VALUES (211, 207, TIMESTAMP WITH TIME ZONE '2019-05-16 15:12:14+00', 'No sangue avorrecido, estava vendo;
');
	VALUES (211, 220, TIMESTAMP WITH TIME ZONE '2019-05-16 21:09:40+00', '"Fez primeiro em Coimbra exercitar-se
');
	VALUES (211, 220, TIMESTAMP WITH TIME ZONE '2019-05-17 03:36:10+00', 'As Alcióneas aves triste canto
');

	VALUES (212, 208, TIMESTAMP WITH TIME ZONE '2021-04-15 07:57:59+00', 'Mais mimosa que triste ao Padre fala:
');
	VALUES (212, 647, TIMESTAMP WITH TIME ZONE '2021-04-15 10:52:13+00', 'Por Sara Faraó, Siquém por Dina.
');

	VALUES (213, 208, TIMESTAMP WITH TIME ZONE '2021-04-20 17:10:51+00', 'Que os corações humanos tanto obriga,
');

	VALUES (214, 260, TIMESTAMP WITH TIME ZONE '2020-07-16 00:38:10+00', 'Mostrando-se no mar um fero raio,
');
	VALUES (214, 260, TIMESTAMP WITH TIME ZONE '2020-07-16 04:53:09+00', 'De trabalhos mui grande sofredor;
');
	VALUES (214, 260, TIMESTAMP WITH TIME ZONE '2020-07-16 10:52:00+00', '"As províncias que entre um e o outro rio
');
	VALUES (214, 209, TIMESTAMP WITH TIME ZONE '2020-07-16 18:11:04+00', 'Sem que ache resistência nem perigos,
');

	VALUES (215, 211, TIMESTAMP WITH TIME ZONE '2020-11-30 09:16:50+00', 'Que, os aposentos cáspios habitando,
');

	VALUES (216, 371, TIMESTAMP WITH TIME ZONE '2020-12-04 19:21:09+00', 'Pelos sombrios matos e florestas
');
	VALUES (216, 211, TIMESTAMP WITH TIME ZONE '2020-12-04 20:24:32+00', 'Que quem da Hespéria última alongada,
');
	VALUES (216, 371, TIMESTAMP WITH TIME ZONE '2020-12-05 02:30:29+00', 'Olha que de Narsinga o senhorio
');

	VALUES (217, 212, TIMESTAMP WITH TIME ZONE '2020-11-20 15:30:00+00', 'Muitos casos futuros lhe apresenta.
');

	VALUES (218, 577, TIMESTAMP WITH TIME ZONE '2020-10-29 09:01:39+00', 'E propondo-lhe a causa a que desceu,
');
	VALUES (218, 212, TIMESTAMP WITH TIME ZONE '2020-10-29 10:03:45+00', 'Viam-se em derredor ferver as praias
');

	VALUES (219, 341, TIMESTAMP WITH TIME ZONE '2019-10-02 10:43:11+00', 'Sem passar se deteve muitos dias:
');
	VALUES (219, 213, TIMESTAMP WITH TIME ZONE '2019-10-02 14:18:47+00', 'O vento dorme, o mar e as ondas jazem.
');

	VALUES (220, 688, TIMESTAMP WITH TIME ZONE '2020-08-30 23:16:56+00', 'O Regedor daquela iníqua terra,
');
	VALUES (220, 688, TIMESTAMP WITH TIME ZONE '2020-08-31 07:02:29+00', 'Vê que do lago donde se derrama
');

	VALUES (221, 214, TIMESTAMP WITH TIME ZONE '2020-12-01 04:16:19+00', 'Pressago o coração me prometia,
');

	VALUES (222, 358, TIMESTAMP WITH TIME ZONE '2018-07-30 13:41:41+00', 'Ouvindo as opressões que na passagem
');
	VALUES (222, 215, TIMESTAMP WITH TIME ZONE '2018-07-30 18:54:52+00', 'Em quem quer reprovar da Igreja o canto.
');

	VALUES (223, 586, TIMESTAMP WITH TIME ZONE '2020-05-26 11:27:17+00', 'Que alaga os campos largos e inquieta;
');
	VALUES (223, 215, TIMESTAMP WITH TIME ZONE '2020-05-26 18:21:07+00', 'Tanto como qualquer Romano antigo.
');

	VALUES (224, 216, TIMESTAMP WITH TIME ZONE '2020-08-17 16:01:05+00', 'A nova ilha Maluco, com a canela,
');

	VALUES (225, 217, TIMESTAMP WITH TIME ZONE '2021-02-16 04:55:32+00', 'Logo os montes da Ninfa sepultada
');
	VALUES (225, 248, TIMESTAMP WITH TIME ZONE '2021-02-16 11:56:13+00', 'Assopra-lhe galerno o vento, e brando,
');
	VALUES (225, 248, TIMESTAMP WITH TIME ZONE '2021-02-16 19:28:51+00', 'Que ilustrada será co a Lei divina.
');

	VALUES (226, 217, TIMESTAMP WITH TIME ZONE '2019-11-03 21:58:53+00', 'Que Tethys indignada lhe bradou:
');
	VALUES (226, 344, TIMESTAMP WITH TIME ZONE '2019-11-04 05:36:56+00', 'Que eu tanto tempo há já que guardo e tenho,
');

	VALUES (227, 218, TIMESTAMP WITH TIME ZONE '2021-04-02 00:56:23+00', 'Que da paternal coxa foi nascido,
');
	VALUES (227, 334, TIMESTAMP WITH TIME ZONE '2021-04-02 08:07:24+00', 'Põe tu, Ninfa, em efeito meu desejo,
');
	VALUES (227, 218, TIMESTAMP WITH TIME ZONE '2021-04-02 11:24:22+00', '(Já que o juízo humano tanto erra)
');

	VALUES (228, 661, TIMESTAMP WITH TIME ZONE '2020-03-03 22:18:21+00', 'E por estes ao Rei presentes manda,
');

	VALUES (229, 219, TIMESTAMP WITH TIME ZONE '2020-09-11 15:07:51+00', 'Dos imigos, gritando o céu tocavam,
');

	VALUES (230, 220, TIMESTAMP WITH TIME ZONE '2020-05-30 13:53:07+00', 'Com os Portugueses já contra Castela,
');
	VALUES (230, 220, TIMESTAMP WITH TIME ZONE '2020-05-30 16:41:25+00', 'Que também dela hão medo os Elementos!
');
	VALUES (230, 220, TIMESTAMP WITH TIME ZONE '2020-05-30 22:53:54+00', '"Este receberá, plácido e brando,
');
	VALUES (230, 220, TIMESTAMP WITH TIME ZONE '2020-05-31 03:16:03+00', 'E, por memória eterna, em fonte pura
');

	VALUES (231, 222, TIMESTAMP WITH TIME ZONE '2020-06-11 13:20:26+00', 'Cumprido esse desejo te seria;
');
	VALUES (231, 222, TIMESTAMP WITH TIME ZONE '2020-06-11 19:30:05+00', 'Veias d''ouro que a terra produziu,
');

	VALUES (232, 298, TIMESTAMP WITH TIME ZONE '2019-09-27 07:37:49+00', 'Que as Estrelas e o Céu e o Ar vizinho,
');
	VALUES (232, 224, TIMESTAMP WITH TIME ZONE '2019-09-27 10:29:30+00', 'Onde a matéria da obra é superada,
');
	VALUES (232, 224, TIMESTAMP WITH TIME ZONE '2019-09-27 14:31:41+00', 'Onde o Cabo Arsinário o nome perde,
');

	VALUES (233, 410, TIMESTAMP WITH TIME ZONE '2019-07-25 09:11:41+00', 'A troco da palavra mal cumprida.
');

	VALUES (234, 225, TIMESTAMP WITH TIME ZONE '2019-09-23 04:53:32+00', 'De Ceita está o fortíssimo leão,
');
	VALUES (234, 225, TIMESTAMP WITH TIME ZONE '2019-09-23 09:31:49+00', 'Para que o Véu dourado combatessem,
');
	VALUES (234, 329, TIMESTAMP WITH TIME ZONE '2019-09-23 13:41:55+00', 'Qual, enfim, o Arquetipo que o criou.
');

	VALUES (235, 264, TIMESTAMP WITH TIME ZONE '2020-12-01 07:41:51+00', 'Sancho quis ajudar na guerra fera,
');
	VALUES (235, 264, TIMESTAMP WITH TIME ZONE '2020-12-01 10:28:29+00', 'Cujo nome não pode ser defunto
');
	VALUES (235, 264, TIMESTAMP WITH TIME ZONE '2020-12-01 15:22:42+00', 'Mas, numa mão a pena e noutra a lança,
');

	VALUES (236, 226, TIMESTAMP WITH TIME ZONE '2020-12-27 02:13:41+00', 'Temperado com um árduo sofrimento;
');

	VALUES (237, 447, TIMESTAMP WITH TIME ZONE '2021-05-22 14:50:59+00', 'Que não se enxerga: é o Móbile primeiro.
');

	VALUES (238, 228, TIMESTAMP WITH TIME ZONE '2021-05-06 22:31:10+00', 'Apolo, e as Musas que me acompanharam,
');
	VALUES (238, 315, TIMESTAMP WITH TIME ZONE '2021-05-07 01:32:16+00', 'Tudo fico que rompas e sometas.
');
	VALUES (238, 315, TIMESTAMP WITH TIME ZONE '2021-05-07 01:51:06+00', 'Não causaram que o vaso da niquícia,
');

	VALUES (239, 228, TIMESTAMP WITH TIME ZONE '2021-05-07 15:18:01+00', 'Quanto, em conselho, sábio e bem cuidado.
');
	VALUES (239, 228, TIMESTAMP WITH TIME ZONE '2021-05-07 16:00:37+00', 'Armadas que as ribeiras venceriam
');
	VALUES (239, 345, TIMESTAMP WITH TIME ZONE '2021-05-07 22:15:37+00', 'Das águas, alguma ínsula divina,
');

	VALUES (240, 230, TIMESTAMP WITH TIME ZONE '2019-06-07 08:30:20+00', 'Tremer dele Neptuno, de medroso
');

	VALUES (241, 635, TIMESTAMP WITH TIME ZONE '2020-05-20 02:43:06+00', 'Contam por certos sempre e verdadeiros,
');
	VALUES (241, 231, TIMESTAMP WITH TIME ZONE '2020-05-20 03:06:06+00', 'Vês aqui as mãos e a língua delinquentes:
');

	VALUES (242, 373, TIMESTAMP WITH TIME ZONE '2020-05-09 15:34:25+00', 'O que arcos e pelouros não fizeram.
');

	VALUES (243, 233, TIMESTAMP WITH TIME ZONE '2020-11-25 05:35:06+00', 'Ó pérfida, inimiga e falsa gente!
');
	VALUES (243, 233, TIMESTAMP WITH TIME ZONE '2020-11-25 07:33:58+00', 'Os Deuses, e por mais dobradas mágoas,
');

	VALUES (244, 348, TIMESTAMP WITH TIME ZONE '2020-10-24 07:50:41+00', 'Logramos o metal rico e luzente,
');
	VALUES (244, 348, TIMESTAMP WITH TIME ZONE '2020-10-24 13:27:21+00', 'Quedas coas duras armas, tudo atroam;
');

	VALUES (245, 234, TIMESTAMP WITH TIME ZONE '2021-01-12 13:12:45+00', 'Por onde duas vezes passa Apolo,
');
	VALUES (245, 529, TIMESTAMP WITH TIME ZONE '2021-01-12 19:21:54+00', 'Que mais chegada à terra parecia,
');
	VALUES (245, 234, TIMESTAMP WITH TIME ZONE '2021-01-12 23:38:10+00', 'Venham Deuses a ser, e nós humanos.
');

	VALUES (246, 677, TIMESTAMP WITH TIME ZONE '2021-01-13 13:51:24+00', 'A outra gente a quartos vigiava;
');

	VALUES (247, 485, TIMESTAMP WITH TIME ZONE '2019-09-25 20:08:29+00', 'Dando pasto diverso e dando vida
');
	VALUES (247, 235, TIMESTAMP WITH TIME ZONE '2019-09-26 02:01:18+00', 'Mas os Mouros que andavam pela praia,
');
	VALUES (247, 235, TIMESTAMP WITH TIME ZONE '2019-09-26 09:19:05+00', 'Com os outros dois o carro radiante,
');

	VALUES (248, 235, TIMESTAMP WITH TIME ZONE '2019-01-15 02:29:21+00', 'O Rei, que já sabia da nobreza
');
	VALUES (248, 235, TIMESTAMP WITH TIME ZONE '2019-01-15 05:02:42+00', 'Com as duas cabeças dos vigias,
');

	VALUES (249, 237, TIMESTAMP WITH TIME ZONE '2019-12-16 13:20:27+00', 'Ajunta-se a inimiga multidão
');
	VALUES (249, 237, TIMESTAMP WITH TIME ZONE '2019-12-16 16:10:08+00', 'Cunha, que longo tempo tem o leme:
');

	VALUES (250, 238, TIMESTAMP WITH TIME ZONE '2019-05-06 14:26:53+00', 'A vergonha da Deusa caçadora,
');
	VALUES (250, 462, TIMESTAMP WITH TIME ZONE '2019-05-06 19:14:39+00', 'As palavras dum vago navegante.
');

	VALUES (251, 540, TIMESTAMP WITH TIME ZONE '2020-09-06 06:16:22+00', 'Tão suave, doméstica e benigna,
');
	VALUES (251, 540, TIMESTAMP WITH TIME ZONE '2020-09-06 13:52:00+00', 'Aonde Hele deixou co''o nome a vida,
');
	VALUES (251, 244, TIMESTAMP WITH TIME ZONE '2020-09-06 18:20:41+00', 'Em batalha cruel o peito humano,
');

	VALUES (252, 317, TIMESTAMP WITH TIME ZONE '2021-05-09 04:32:48+00', '"Ali o poder de muitos inimigos
');
	VALUES (252, 244, TIMESTAMP WITH TIME ZONE '2021-05-09 07:23:07+00', 'Por serem, dando à costa, destruídos;
');
	VALUES (252, 317, TIMESTAMP WITH TIME ZONE '2021-05-09 09:23:54+00', 'O que mais passam na manhã, e na sesta,
');
	VALUES (252, 244, TIMESTAMP WITH TIME ZONE '2021-05-09 10:51:56+00', 'Duro freio porá, e a toda a terra
');

	VALUES (253, 375, TIMESTAMP WITH TIME ZONE '2018-12-15 19:00:34+00', 'E dando uma pancada penetrante,
');
	VALUES (253, 375, TIMESTAMP WITH TIME ZONE '2018-12-15 19:11:01+00', 'Bebendo a recolheu na fonte fria)
');
	VALUES (253, 375, TIMESTAMP WITH TIME ZONE '2018-12-16 00:34:52+00', 'E tem o caminho húmido impedido,
');
	VALUES (253, 375, TIMESTAMP WITH TIME ZONE '2018-12-16 06:31:36+00', 'Não parte o Gama enfim, que lho defende
');

	VALUES (254, 245, TIMESTAMP WITH TIME ZONE '2019-02-01 20:53:58+00', 'Recebe o Capitão alegremente
');
	VALUES (254, 281, TIMESTAMP WITH TIME ZONE '2019-02-02 03:10:42+00', 'Para a frota, no seu batel ligeiro.
');

	VALUES (255, 247, TIMESTAMP WITH TIME ZONE '2021-01-15 11:08:13+00', 'Para ver se conforme à sua seja,
');
	VALUES (255, 668, TIMESTAMP WITH TIME ZONE '2021-01-15 16:04:16+00', '"A estas nobres vilas sometidas,
');
	VALUES (255, 668, TIMESTAMP WITH TIME ZONE '2021-01-15 21:03:54+00', 'Por Rei, quando da vida se apartou
');

	VALUES (256, 248, TIMESTAMP WITH TIME ZONE '2021-02-26 14:50:03+00', 'Que há de ser celebrada a clara Deia,
');
	VALUES (256, 248, TIMESTAMP WITH TIME ZONE '2021-02-26 17:19:27+00', 'Porfiam: tinge o ferro o sangue ardente;
');
	VALUES (256, 351, TIMESTAMP WITH TIME ZONE '2021-02-27 00:07:54+00', 'A vista vossa tema o monte Atlante,
');
	VALUES (256, 351, TIMESTAMP WITH TIME ZONE '2021-02-27 08:04:21+00', 'Quando com maior grita ao Rei relatam
');

	VALUES (257, 248, TIMESTAMP WITH TIME ZONE '2021-01-01 13:22:09+00', 'No mar também aos Mouros dando a morto,
');

	VALUES (258, 650, TIMESTAMP WITH TIME ZONE '2020-03-07 03:27:16+00', 'Dizem que provarão, que honras e famas
');
	VALUES (258, 650, TIMESTAMP WITH TIME ZONE '2020-03-07 06:20:01+00', 'Gentes de todo o Reino, cuja usança
');

	VALUES (259, 249, TIMESTAMP WITH TIME ZONE '2019-09-12 18:23:34+00', 'Ali, em cadeiras ricas, cristalinas,
');
	VALUES (259, 490, TIMESTAMP WITH TIME ZONE '2019-09-12 18:32:28+00', 'Segundo foi o engano descoberto.
');
	VALUES (259, 249, TIMESTAMP WITH TIME ZONE '2019-09-12 20:51:38+00', 'As divide: e o mar que, fero e horrendo,
');

	VALUES (260, 250, TIMESTAMP WITH TIME ZONE '2021-01-06 15:09:26+00', 'Cuja mata é do pau cheiroso ornada;
');

	VALUES (261, 251, TIMESTAMP WITH TIME ZONE '2020-05-11 12:06:36+00', 'Onde em lágrimas viva eternamente.
');
	VALUES (261, 251, TIMESTAMP WITH TIME ZONE '2020-05-11 20:06:17+00', 'O grande Capitão chamar mandava,
');

	VALUES (262, 251, TIMESTAMP WITH TIME ZONE '2020-05-18 21:30:31+00', 'O que depois mil vezes amestramos.
');

	VALUES (263, 552, TIMESTAMP WITH TIME ZONE '2021-01-27 00:11:06+00', 'Da Índia grande e rica, por mandado
');
	VALUES (263, 254, TIMESTAMP WITH TIME ZONE '2021-01-27 05:30:52+00', 'E que, se mantimento lhe falece,
');
	VALUES (263, 552, TIMESTAMP WITH TIME ZONE '2021-01-27 10:15:48+00', '"Também farão Mombaça, que se arreia
');

	VALUES (264, 254, TIMESTAMP WITH TIME ZONE '2019-12-23 07:20:34+00', 'As vezes leis magnânimas quebranta.
');

	VALUES (265, 255, TIMESTAMP WITH TIME ZONE '2019-08-25 17:43:14+00', 'Mas de Deus foi vingada em tempo breve:
');
	VALUES (265, 481, TIMESTAMP WITH TIME ZONE '2019-08-25 21:56:24+00', 'No Povo, com nós outros quase mudo.
');
	VALUES (265, 255, TIMESTAMP WITH TIME ZONE '2019-08-25 23:45:58+00', 'A quem ao bem comum e do seu Rei
');
	VALUES (265, 255, TIMESTAMP WITH TIME ZONE '2019-08-26 00:20:10+00', 'Se mostra um bando negro descoberto.
');

	VALUES (266, 426, TIMESTAMP WITH TIME ZONE '2019-09-25 11:38:16+00', 'Enxergaram terra alta pela proa.
');
	VALUES (266, 255, TIMESTAMP WITH TIME ZONE '2019-09-25 16:04:52+00', 'Na sexta idade andava enfermo e lento:
');

	VALUES (267, 388, TIMESTAMP WITH TIME ZONE '2020-09-26 08:16:47+00', 'Como já o fero Huno o foi primeiro
');
	VALUES (267, 388, TIMESTAMP WITH TIME ZONE '2020-09-26 09:01:39+00', '"E por isso do Olimpo já fugi,
');
	VALUES (267, 388, TIMESTAMP WITH TIME ZONE '2020-09-26 14:09:22+00', 'Mensageira do dia, e visitava
');

	VALUES (268, 257, TIMESTAMP WITH TIME ZONE '2020-10-02 19:19:47+00', 'Do Céu supremo quis que povoasse.
');
	VALUES (268, 662, TIMESTAMP WITH TIME ZONE '2020-10-03 01:47:45+00', 'E por que tudo enfim vos notifique,
');
	VALUES (268, 257, TIMESTAMP WITH TIME ZONE '2020-10-03 03:33:57+00', 'Salta, corre, sibila, acena, e brada,
');

	VALUES (269, 258, TIMESTAMP WITH TIME ZONE '2019-05-08 15:58:19+00', 'Que depois que levasse esta certeza,
');
	VALUES (269, 258, TIMESTAMP WITH TIME ZONE '2019-05-08 17:07:41+00', 'De banhar os bigodes retorcidos.
');
	VALUES (269, 425, TIMESTAMP WITH TIME ZONE '2019-05-09 00:23:12+00', 'Puseram em fugida, de maneira
');

	VALUES (270, 258, TIMESTAMP WITH TIME ZONE '2020-03-14 02:42:33+00', 'Dizendo em alta voz:--"Real, real,
');

	VALUES (271, 261, TIMESTAMP WITH TIME ZONE '2019-12-02 04:05:54+00', 'A nada disto o bruto se movia.
');
	VALUES (271, 261, TIMESTAMP WITH TIME ZONE '2019-12-02 04:15:57+00', 'Serão dadas na terra leis melhores.
');

	VALUES (272, 261, TIMESTAMP WITH TIME ZONE '2021-03-29 22:50:09+00', 'Bem vês como se veste e faz ornado
');
	VALUES (272, 551, TIMESTAMP WITH TIME ZONE '2021-03-30 05:35:27+00', 'Por manhas mais subtis e ardis melhores,
');
	VALUES (272, 261, TIMESTAMP WITH TIME ZONE '2021-03-30 11:16:13+00', 'Vês outro, que do Tejo a terra pisa,
');

	VALUES (273, 262, TIMESTAMP WITH TIME ZONE '2021-02-09 03:34:23+00', '"Aqui, só verdadeiros, gloriosos
');
	VALUES (273, 262, TIMESTAMP WITH TIME ZONE '2021-02-09 09:17:43+00', 'Me detenho em tomar do Sol a altura
');

	VALUES (274, 262, TIMESTAMP WITH TIME ZONE '2021-02-17 04:22:55+00', 'Sirenas que com o canto os adormeçam;
');
	VALUES (274, 262, TIMESTAMP WITH TIME ZONE '2021-02-17 06:51:51+00', 'Posto que a algum contrário lhe pesasse;
');

	VALUES (275, 263, TIMESTAMP WITH TIME ZONE '2020-12-03 20:04:47+00', 'De longe a Ilha viram fresca e bela,
');
	VALUES (275, 684, TIMESTAMP WITH TIME ZONE '2020-12-03 23:36:46+00', '--"Aos infiéis, Senhor, aos infiéis,
');

	VALUES (276, 491, TIMESTAMP WITH TIME ZONE '2020-06-16 17:37:33+00', 'De seu Rei, que lhe manda que não saia,
');
	VALUES (276, 266, TIMESTAMP WITH TIME ZONE '2020-06-16 22:44:36+00', 'Nos perigos passados vão falando,
');
	VALUES (276, 266, TIMESTAMP WITH TIME ZONE '2020-06-16 23:56:58+00', 'Mais e mais a tormenta acrescentavam
');
	VALUES (276, 491, TIMESTAMP WITH TIME ZONE '2020-06-17 05:19:30+00', 'Em não negar batalha ao bravo Mouro;
');

	VALUES (277, 267, TIMESTAMP WITH TIME ZONE '2021-02-27 08:53:57+00', 'Escuros deixam sempre seus menores,
');
	VALUES (277, 382, TIMESTAMP WITH TIME ZONE '2021-02-27 14:44:42+00', 'A quantas gentes vês, porás o freio."--
');

	VALUES (278, 540, TIMESTAMP WITH TIME ZONE '2020-08-21 12:22:34+00', 'E na fidelidade dos vizinhos;
');
	VALUES (278, 540, TIMESTAMP WITH TIME ZONE '2020-08-21 14:29:23+00', 'Vigiando, e vestindo o forjado aço,
');

	VALUES (279, 269, TIMESTAMP WITH TIME ZONE '2020-06-09 17:20:32+00', 'Que também com suas armas se moveu,
');
	VALUES (279, 586, TIMESTAMP WITH TIME ZONE '2020-06-09 17:51:04+00', 'Viúva e triste, e posta em vida escura,
');

	VALUES (280, 270, TIMESTAMP WITH TIME ZONE '2021-01-22 00:31:42+00', 'Vai ajudar ao bravo Castelhano,
');
	VALUES (280, 658, TIMESTAMP WITH TIME ZONE '2021-01-22 00:36:53+00', '--"Ó tu, a cujos reinos e coroa
');
	VALUES (280, 270, TIMESTAMP WITH TIME ZONE '2021-01-22 03:31:06+00', 'Veja agora o juízo curioso
');
	VALUES (280, 270, TIMESTAMP WITH TIME ZONE '2021-01-22 08:20:13+00', 'A tolher que não passe o Rei gentio
');

	VALUES (281, 272, TIMESTAMP WITH TIME ZONE '2019-03-27 09:36:06+00', 'Na alagoa Meotis, curvo o frio,
');

	VALUES (282, 463, TIMESTAMP WITH TIME ZONE '2019-10-10 06:08:27+00', 'Ali se enche e se alarga grandemente:
');
	VALUES (282, 463, TIMESTAMP WITH TIME ZONE '2019-10-10 10:29:28+00', 'Da menina que a trouxe na capela,
');

	VALUES (283, 273, TIMESTAMP WITH TIME ZONE '2020-01-17 02:00:43+00', '(Sem lhe valerem ordens) de alta torre,
');
	VALUES (283, 295, TIMESTAMP WITH TIME ZONE '2020-01-17 08:59:45+00', 'Já da real presença veneranda
');

	VALUES (284, 274, TIMESTAMP WITH TIME ZONE '2020-07-19 00:23:04+00', 'Eu por ti, rudo, velo; e tu adormeces!
');
	VALUES (284, 274, TIMESTAMP WITH TIME ZONE '2020-07-19 06:58:21+00', 'Suceder-lhe-á ali Castro, que o estandarte
');
	VALUES (284, 437, TIMESTAMP WITH TIME ZONE '2020-07-19 13:13:37+00', 'Criando-a Reino ilustre; e foi desta arte:
');

	VALUES (285, 274, TIMESTAMP WITH TIME ZONE '2020-07-10 16:03:53+00', 'Que afagos tão suaves, que ira honesta,
');
	VALUES (285, 274, TIMESTAMP WITH TIME ZONE '2020-07-10 23:16:21+00', 'Que claramente põem aberto o rosto
');
	VALUES (285, 274, TIMESTAMP WITH TIME ZONE '2020-07-11 03:21:59+00', 'Primeiro tratarei da larga terra,
');

	VALUES (286, 413, TIMESTAMP WITH TIME ZONE '2020-06-22 20:48:10+00', 'Obedeceis às forças mais que humanas,
');
	VALUES (286, 275, TIMESTAMP WITH TIME ZONE '2020-06-23 02:23:47+00', 'Do que lhe der a língua conselheira.
');

	VALUES (287, 536, TIMESTAMP WITH TIME ZONE '2020-11-19 21:48:09+00', 'Sobre seus duros ombros a sustenta.
');
	VALUES (287, 278, TIMESTAMP WITH TIME ZONE '2020-11-20 02:11:20+00', 'Em casos desta sorte duvidosos,
');

	VALUES (288, 280, TIMESTAMP WITH TIME ZONE '2019-05-19 18:09:42+00', 'Conta que a mãe, tomando todo o estado,
');
	VALUES (288, 280, TIMESTAMP WITH TIME ZONE '2019-05-20 00:36:38+00', 'Entre vós firmemente permaneça,
');
	VALUES (288, 280, TIMESTAMP WITH TIME ZONE '2019-05-20 00:52:24+00', 'Ao som da Mauritana e ronca tuba,
');
	VALUES (288, 280, TIMESTAMP WITH TIME ZONE '2019-05-20 01:54:44+00', 'Que quem delas tiver notícia inteira,
');

	VALUES (289, 580, TIMESTAMP WITH TIME ZONE '2019-05-08 21:17:38+00', 'Para onde a forte armada se enxergava;
');
	VALUES (289, 580, TIMESTAMP WITH TIME ZONE '2019-05-09 00:29:05+00', 'Este interpreta mais que sutilmente.
');
	VALUES (289, 580, TIMESTAMP WITH TIME ZONE '2019-05-09 07:00:11+00', 'Logo, corno tornou do Reino o cargo,
');
	VALUES (289, 580, TIMESTAMP WITH TIME ZONE '2019-05-09 09:24:16+00', 'Breve repouso então aos olhos dava,
');

	VALUES (290, 344, TIMESTAMP WITH TIME ZONE '2021-02-07 11:51:03+00', '(Infiéis deixo) tantas heresias?
');
	VALUES (290, 283, TIMESTAMP WITH TIME ZONE '2021-02-07 19:16:25+00', 'Com mais noventa e sete, em que corria,
');
	VALUES (290, 283, TIMESTAMP WITH TIME ZONE '2021-02-07 22:56:30+00', 'Tomé vinha prègando, e já passara
');
	VALUES (290, 283, TIMESTAMP WITH TIME ZONE '2021-02-08 01:36:35+00', 'Dous inimigos vencem: uns, os vivos,
');

	VALUES (291, 600, TIMESTAMP WITH TIME ZONE '2021-03-01 03:48:46+00', 'Nas cousas de que tem notícia e faina.
');
	VALUES (291, 600, TIMESTAMP WITH TIME ZONE '2021-03-01 09:10:44+00', 'Pelas guerras famosas e excelentes
');

	VALUES (292, 465, TIMESTAMP WITH TIME ZONE '2019-08-15 03:59:37+00', 'Entre a gente que a vê-lo concorria,
');
	VALUES (292, 465, TIMESTAMP WITH TIME ZONE '2019-08-15 10:31:42+00', '"Porém, como a luz crástina chegada
');
	VALUES (292, 284, TIMESTAMP WITH TIME ZONE '2019-08-15 13:57:53+00', 'Comendo alegremente perguntavam,
');
	VALUES (292, 284, TIMESTAMP WITH TIME ZONE '2019-08-15 14:32:27+00', 'Terras por onde novas maravilhas
');

	VALUES (293, 536, TIMESTAMP WITH TIME ZONE '2021-01-31 10:42:41+00', 'E não força de braço, ó nobre Tito,
');
	VALUES (293, 536, TIMESTAMP WITH TIME ZONE '2021-01-31 11:31:24+00', 'A cor da pele baça e denegrida,
');
	VALUES (293, 536, TIMESTAMP WITH TIME ZONE '2021-01-31 13:06:01+00', 'De cetim da Adriática Veneza
');
	VALUES (293, 286, TIMESTAMP WITH TIME ZONE '2021-01-31 14:38:30+00', 'Da figura nos muros, que primeira
');

	VALUES (294, 300, TIMESTAMP WITH TIME ZONE '2020-06-08 10:45:06+00', 'Que também com suas armas se moveu,
');
	VALUES (294, 289, TIMESTAMP WITH TIME ZONE '2020-06-08 16:52:46+00', 'De todo o Roxo mar mais florescia,
');
	VALUES (294, 300, TIMESTAMP WITH TIME ZONE '2020-06-08 18:02:05+00', 'O vosso Tejo cria valorosos,
');
	VALUES (294, 300, TIMESTAMP WITH TIME ZONE '2020-06-08 20:53:34+00', 'Que pelos altos paços vão soando,
');

	VALUES (295, 290, TIMESTAMP WITH TIME ZONE '2018-12-30 15:51:22+00', 'De já nos não tornar a ver tão cedo.
');
	VALUES (295, 490, TIMESTAMP WITH TIME ZONE '2018-12-30 21:36:47+00', 'Mas atenta: já cá destoutra banda
');
	VALUES (295, 490, TIMESTAMP WITH TIME ZONE '2018-12-31 02:58:36+00', 'Ajunta também Mafra, em pouco espaço,
');
	VALUES (295, 290, TIMESTAMP WITH TIME ZONE '2018-12-31 10:27:56+00', 'Da sua Campaspe, e deu-lha alegremente,
');

	VALUES (296, 292, TIMESTAMP WITH TIME ZONE '2021-03-21 01:49:14+00', 'Que a seu costume estava ruminando.
');
	VALUES (296, 292, TIMESTAMP WITH TIME ZONE '2021-03-21 03:50:50+00', 'Por me lembrar que estáveis cá sem
');

	VALUES (297, 293, TIMESTAMP WITH TIME ZONE '2020-09-04 02:22:51+00', 'Amostrando-se a Afonso, o animava.
');
	VALUES (297, 293, TIMESTAMP WITH TIME ZONE '2020-09-04 06:29:21+00', 'Os braços pelo colo lhe lançou,
');

	VALUES (298, 294, TIMESTAMP WITH TIME ZONE '2021-02-19 16:51:37+00', 'Não sei por que razão, por que respeito,
');
	VALUES (298, 516, TIMESTAMP WITH TIME ZONE '2021-02-19 22:13:38+00', 'O prazer de chegar à pátria cara,
');
	VALUES (298, 294, TIMESTAMP WITH TIME ZONE '2021-02-20 03:07:14+00', 'Já devem de fazer as duras provas
');

	VALUES (299, 655, TIMESTAMP WITH TIME ZONE '2019-12-16 18:48:31+00', 'Nem com lágrimas tristes se mitiga,
');
	VALUES (299, 655, TIMESTAMP WITH TIME ZONE '2019-12-17 01:35:29+00', 'Monçaide entre eles vai interpretando
');
	VALUES (299, 655, TIMESTAMP WITH TIME ZONE '2019-12-17 07:59:18+00', 'Os Delis, os Patanes, que em possança
');

	VALUES (300, 295, TIMESTAMP WITH TIME ZONE '2021-04-23 22:00:19+00', 'C''um tom de voz começa, grave e horrendo:
');

	VALUES (301, 543, TIMESTAMP WITH TIME ZONE '2020-09-22 01:47:17+00', 'Vão, e também dos nobres, ao profundo,
');
	VALUES (301, 543, TIMESTAMP WITH TIME ZONE '2020-09-22 09:38:35+00', 'Ou lá dalguns que do Pírene desçam.
');
	VALUES (301, 296, TIMESTAMP WITH TIME ZONE '2020-09-22 17:19:50+00', 'Com que nos poucos seus o esforço cresce.
');

	VALUES (302, 298, TIMESTAMP WITH TIME ZONE '2019-11-01 06:22:07+00', 'Quersoneso foi dita; e das prestantes
');
	VALUES (302, 298, TIMESTAMP WITH TIME ZONE '2019-11-01 06:33:27+00', 'E que, por comprazer ao vulgo errante,
');
	VALUES (302, 298, TIMESTAMP WITH TIME ZONE '2019-11-01 11:26:02+00', 'Ferido o ar retumba e assovia:
');

	VALUES (303, 300, TIMESTAMP WITH TIME ZONE '2020-12-25 13:05:30+00', 'Ou porque o amor antigo o obrigava,
');
	VALUES (303, 300, TIMESTAMP WITH TIME ZONE '2020-12-25 20:23:33+00', 'Por nos roubarem mais a seu seguro.
');
	VALUES (303, 300, TIMESTAMP WITH TIME ZONE '2020-12-25 21:22:34+00', 'Converte em pedra o pau que nele cai.
');
	VALUES (303, 300, TIMESTAMP WITH TIME ZONE '2020-12-26 03:12:33+00', 'Assim foram os Mínias ajuntados,
');

	VALUES (304, 561, TIMESTAMP WITH TIME ZONE '2020-05-25 21:51:38+00', 'Por que não saiba nunca onde se estende
');

	VALUES (305, 303, TIMESTAMP WITH TIME ZONE '2020-01-13 00:10:17+00', 'Assim recebem junto e dão feridas,
');

	VALUES (306, 343, TIMESTAMP WITH TIME ZONE '2020-04-07 07:03:28+00', 'Estava para dar ao Gama aviso,
');
	VALUES (306, 303, TIMESTAMP WITH TIME ZONE '2020-04-07 10:55:16+00', '"Depois que foi por Rei alevantado,
');
	VALUES (306, 303, TIMESTAMP WITH TIME ZONE '2020-04-07 18:13:03+00', 'Com doce voz está subindo ao Céu
');

	VALUES (307, 527, TIMESTAMP WITH TIME ZONE '2020-01-08 11:53:46+00', 'Também tudo o que pede lhe declara,
');
	VALUES (307, 527, TIMESTAMP WITH TIME ZONE '2020-01-08 12:35:02+00', 'Mas entanto que cegos o sedentos
');
	VALUES (307, 304, TIMESTAMP WITH TIME ZONE '2020-01-08 13:06:38+00', 'Se ainda dura o Gentio antigo rito,
');
	VALUES (307, 304, TIMESTAMP WITH TIME ZONE '2020-01-08 19:35:44+00', 'Estrada o grão Mousés na antiga idade.
');

	VALUES (308, 426, TIMESTAMP WITH TIME ZONE '2020-01-17 04:10:10+00', 'Um barrete vermelho, cor contente.
');
	VALUES (308, 426, TIMESTAMP WITH TIME ZONE '2020-01-17 08:50:55+00', 'O que no gesto belo se parece,
');
	VALUES (308, 426, TIMESTAMP WITH TIME ZONE '2020-01-17 09:18:22+00', 'Enquanto a luz cobriu o escuro manto;
');

	VALUES (309, 305, TIMESTAMP WITH TIME ZONE '2020-06-21 02:54:34+00', 'Mas nem cobiça, ou pouca obediência
');
	VALUES (309, 305, TIMESTAMP WITH TIME ZONE '2020-06-21 09:50:48+00', 'Naires chamados são, e a menos digna
');

	VALUES (310, 306, TIMESTAMP WITH TIME ZONE '2020-09-26 15:07:59+00', 'Onde as praias e vales bem se viam,
');
	VALUES (310, 314, TIMESTAMP WITH TIME ZONE '2020-09-26 17:03:24+00', 'Não cabe o altivo peito, tão pequeno.
');
	VALUES (310, 306, TIMESTAMP WITH TIME ZONE '2020-09-26 17:44:20+00', 'E no mar resplandece juntamente,
');
	VALUES (310, 306, TIMESTAMP WITH TIME ZONE '2020-09-26 19:36:25+00', 'E a vontade à dádiva excedia.
');

	VALUES (311, 306, TIMESTAMP WITH TIME ZONE '2020-07-09 22:11:21+00', 'Súbito diante os olhos se apartou;
');

	VALUES (312, 536, TIMESTAMP WITH TIME ZONE '2019-03-16 22:08:25+00', 'E palavras sinceras, não dobradas,
');
	VALUES (312, 536, TIMESTAMP WITH TIME ZONE '2019-03-17 05:36:15+00', 'Português, porém não na lealdade.
');
	VALUES (312, 309, TIMESTAMP WITH TIME ZONE '2019-03-17 12:53:17+00', 'Que em ferros quebra as pernas, indo aceso
');

	VALUES (313, 309, TIMESTAMP WITH TIME ZONE '2020-06-14 05:51:56+00', 'Às aves variadas, que ali saltam,
');

	VALUES (314, 310, TIMESTAMP WITH TIME ZONE '2019-02-24 08:13:11+00', 'África esconde em si luzentes veias;
');
	VALUES (314, 655, TIMESTAMP WITH TIME ZONE '2019-02-24 15:06:56+00', 'É ele pera dar-te um Reino rico.
');

	VALUES (315, 310, TIMESTAMP WITH TIME ZONE '2019-02-20 16:05:43+00', 'Que o nome ilustre a um certo amor obriga
');

	VALUES (316, 623, TIMESTAMP WITH TIME ZONE '2020-02-06 06:47:15+00', 'O principal por quem se governavam
');

	VALUES (317, 313, TIMESTAMP WITH TIME ZONE '2021-01-20 23:29:38+00', 'Para ver se conforme à sua seja,
');
	VALUES (317, 313, TIMESTAMP WITH TIME ZONE '2021-01-21 03:01:24+00', 'Daqui as coisas vivas sempre anima,
');
	VALUES (317, 613, TIMESTAMP WITH TIME ZONE '2021-01-21 03:18:20+00', 'De Cristãos, sendo o teu tão largo e tanto,
');
	VALUES (317, 313, TIMESTAMP WITH TIME ZONE '2021-01-21 05:30:31+00', 'Dá sobre o Rei que cerca a vila forte?
');

	VALUES (318, 313, TIMESTAMP WITH TIME ZONE '2019-08-16 06:14:37+00', 'Fernando em tal fraqueza assim vos pôs,
');
	VALUES (318, 473, TIMESTAMP WITH TIME ZONE '2019-08-16 12:20:40+00', 'Cujo nome não pode ser defunto
');

	VALUES (319, 314, TIMESTAMP WITH TIME ZONE '2020-10-02 11:30:30+00', 'E a piscosa Cezimbra, e juntamente,
');
	VALUES (319, 357, TIMESTAMP WITH TIME ZONE '2020-10-02 18:51:00+00', 'A gente do Sertão, que as terras anda,
');
	VALUES (319, 357, TIMESTAMP WITH TIME ZONE '2020-10-02 22:14:50+00', 'A multidão da gente que perece
');

	VALUES (320, 314, TIMESTAMP WITH TIME ZONE '2020-09-29 20:24:17+00', 'Do negro esquecimento e eterno sono.
');
	VALUES (320, 476, TIMESTAMP WITH TIME ZONE '2020-09-30 00:32:24+00', 'Olhando a cor, o trajo, e a forte armada;
');
	VALUES (320, 476, TIMESTAMP WITH TIME ZONE '2020-09-30 08:20:22+00', 'O nome lhe puseram, que inda dura,
');
	VALUES (320, 314, TIMESTAMP WITH TIME ZONE '2020-09-30 15:54:50+00', 'Desbarata um exército potente:
');

	VALUES (321, 316, TIMESTAMP WITH TIME ZONE '2019-04-28 22:09:17+00', 'Ser esta vida cousa tão pequena.
');
	VALUES (321, 478, TIMESTAMP WITH TIME ZONE '2019-04-29 04:48:20+00', 'E outras várias nações, que o Reno frio
');
	VALUES (321, 316, TIMESTAMP WITH TIME ZONE '2019-04-29 10:48:28+00', 'Províncias mil do mundo, que ensinara.
');

	VALUES (322, 316, TIMESTAMP WITH TIME ZONE '2020-09-19 10:44:41+00', 'Despois que a corporal necessidade
');
	VALUES (322, 348, TIMESTAMP WITH TIME ZONE '2020-09-19 14:43:07+00', 'E o bárbaro poder desbaratara
');
	VALUES (322, 316, TIMESTAMP WITH TIME ZONE '2020-09-19 18:21:18+00', 'De quem não há no mundo semelhança.
');
	VALUES (322, 348, TIMESTAMP WITH TIME ZONE '2020-09-19 22:45:42+00', 'Joane forte sai da fresca Abrantes,
');

	VALUES (323, 344, TIMESTAMP WITH TIME ZONE '2021-02-25 05:09:32+00', 'Vistas enfim de França as coisas grandes,
');
	VALUES (323, 318, TIMESTAMP WITH TIME ZONE '2021-02-25 07:44:40+00', 'Padre, de quem foi sempre amada e eriça,
');
	VALUES (323, 344, TIMESTAMP WITH TIME ZONE '2021-02-25 12:58:28+00', '"Vedes a grande terra que contina
');
	VALUES (323, 344, TIMESTAMP WITH TIME ZONE '2021-02-25 19:03:30+00', 'A feminil fraqueza Pouco usada,
');

	VALUES (324, 318, TIMESTAMP WITH TIME ZONE '2021-03-31 04:36:52+00', 'Donde o piloto falso a leva e guia.
');
	VALUES (324, 579, TIMESTAMP WITH TIME ZONE '2021-03-31 07:56:00+00', '"Esta é a verdade, Rei; que não faria
');

	VALUES (325, 466, TIMESTAMP WITH TIME ZONE '2020-03-25 01:22:38+00', '"Ali o poder de muitos inimigos
');
	VALUES (325, 321, TIMESTAMP WITH TIME ZONE '2020-03-25 03:30:01+00', 'Iam as vias húmidas de argento;
');
	VALUES (325, 466, TIMESTAMP WITH TIME ZONE '2020-03-25 04:27:57+00', 'Já no batel entrou do Capitão
');
	VALUES (325, 321, TIMESTAMP WITH TIME ZONE '2020-03-25 08:26:29+00', 'Ouvindo as opressões que na passagem
');

	VALUES (326, 321, TIMESTAMP WITH TIME ZONE '2020-03-15 19:45:28+00', 'A parecer seguro, ledo, inteiro,
');

	VALUES (327, 385, TIMESTAMP WITH TIME ZONE '2020-11-11 15:06:17+00', 'Foi dele alegremente agasalhado;
');
	VALUES (327, 323, TIMESTAMP WITH TIME ZONE '2020-11-11 22:52:27+00', 'Grandes batalhas tem desbaratadas,
');

	VALUES (328, 558, TIMESTAMP WITH TIME ZONE '2020-10-12 16:15:33+00', 'Tratá-los brandamente determina,
');

	VALUES (329, 530, TIMESTAMP WITH TIME ZONE '2020-03-20 09:56:11+00', 'De cuja falsidade e má vileza
');

	VALUES (330, 687, TIMESTAMP WITH TIME ZONE '2020-02-15 05:48:02+00', 'Muitos casos futuros lhe apresenta.
');
	VALUES (330, 324, TIMESTAMP WITH TIME ZONE '2020-02-15 12:12:12+00', 'De longe a Ilha viram fresca e bela,
');
	VALUES (330, 324, TIMESTAMP WITH TIME ZONE '2020-02-15 19:22:16+00', 'Aqui também por certo pintariam;
');

	VALUES (331, 538, TIMESTAMP WITH TIME ZONE '2020-05-17 09:15:54+00', 'Vasco da Gama, o forte capitão,
');

	VALUES (332, 573, TIMESTAMP WITH TIME ZONE '2020-06-19 01:28:58+00', 'Porque, quem não sabe arte, não na estima.
');
	VALUES (332, 573, TIMESTAMP WITH TIME ZONE '2020-06-19 04:27:29+00', '(Quem viu honra tão longe da verdade?)
');

	VALUES (333, 448, TIMESTAMP WITH TIME ZONE '2020-09-09 19:04:04+00', 'Nos deste: e vês aqui, se atento ouviste,
');
	VALUES (333, 448, TIMESTAMP WITH TIME ZONE '2020-09-10 02:30:31+00', 'Gênero de tormentos inumanos;
');
	VALUES (333, 448, TIMESTAMP WITH TIME ZONE '2020-09-10 06:13:14+00', 'Crendo que seu engano estava noto,
');

	VALUES (334, 401, TIMESTAMP WITH TIME ZONE '2020-10-25 04:55:03+00', 'Vencer o povo ingente de Castela.
');

	VALUES (335, 499, TIMESTAMP WITH TIME ZONE '2020-02-03 12:19:22+00', 'Co''os anafis os Mouros respondiam.
');

	VALUES (336, 654, TIMESTAMP WITH TIME ZONE '2019-12-17 23:47:03+00', 'Do mal de que o empório Zeila geme.
');
	VALUES (336, 654, TIMESTAMP WITH TIME ZONE '2019-12-18 06:25:58+00', 'Quando no mar a armada se estendia.
');
	VALUES (336, 654, TIMESTAMP WITH TIME ZONE '2019-12-18 07:21:49+00', 'Da opinião de todos, na vontade,
');

	VALUES (337, 474, TIMESTAMP WITH TIME ZONE '2020-08-16 15:46:40+00', 'Na gente, assim feroz como infinita,
');

	VALUES (338, 329, TIMESTAMP WITH TIME ZONE '2019-12-10 21:26:29+00', 'Que má tenção, que peito em nós se sente,
');

	VALUES (339, 340, TIMESTAMP WITH TIME ZONE '2019-04-28 20:25:22+00', 'E assim tornei a dar ao vento a vela.
');
	VALUES (339, 331, TIMESTAMP WITH TIME ZONE '2019-04-28 21:49:52+00', '"Esta província, cujo porto agora
');
	VALUES (339, 340, TIMESTAMP WITH TIME ZONE '2019-04-28 23:25:29+00', 'Que não no largo mar, com leda fronte,
');
	VALUES (339, 331, TIMESTAMP WITH TIME ZONE '2019-04-29 00:18:54+00', 'Grinaldas nas cabeças pôr de rosas.
');

	VALUES (340, 673, TIMESTAMP WITH TIME ZONE '2018-07-07 23:00:26+00', 'Mas enxerga-se bem que está composto
');
	VALUES (340, 332, TIMESTAMP WITH TIME ZONE '2018-07-07 23:54:41+00', 'Contra irmãos e parentes (caso estranho!)
');
	VALUES (340, 332, TIMESTAMP WITH TIME ZONE '2018-07-08 00:09:34+00', 'Vir do longínquo Tejo e ignoto Minho,
');
	VALUES (340, 332, TIMESTAMP WITH TIME ZONE '2018-07-08 07:57:08+00', 'De peitos inumanos e insolentes,
');

	VALUES (341, 332, TIMESTAMP WITH TIME ZONE '2019-11-22 15:58:42+00', 'Em batalha cruel o peito humano,
');
	VALUES (341, 332, TIMESTAMP WITH TIME ZONE '2019-11-22 18:25:14+00', 'De saber que fim tinham, e onde estavam
');

	VALUES (342, 333, TIMESTAMP WITH TIME ZONE '2019-08-16 20:45:55+00', 'Não se deter na terra iníqua tanto,
');
	VALUES (342, 333, TIMESTAMP WITH TIME ZONE '2019-08-17 01:41:03+00', 'Eles, como acordados os sentiram,
');
	VALUES (342, 333, TIMESTAMP WITH TIME ZONE '2019-08-17 08:29:24+00', 'E do Giruna frio e Reno fundo.
');
	VALUES (342, 333, TIMESTAMP WITH TIME ZONE '2019-08-17 11:52:10+00', '(Que mil nações ao cerco feras vêm),
');

	VALUES (343, 334, TIMESTAMP WITH TIME ZONE '2021-02-28 05:40:13+00', 'Que furor consentiu que a espada fina,
');
	VALUES (343, 388, TIMESTAMP WITH TIME ZONE '2021-02-28 08:19:46+00', 'Que infantaria segue, esquadra fera.
');
	VALUES (343, 334, TIMESTAMP WITH TIME ZONE '2021-02-28 08:35:28+00', 'Nas naus estar se deixa vagaroso,
');
	VALUES (343, 388, TIMESTAMP WITH TIME ZONE '2021-02-28 11:45:09+00', 'Pela praia arenosa a nós vieram,
');

	VALUES (344, 334, TIMESTAMP WITH TIME ZONE '2021-02-19 04:27:58+00', 'Mas Francesa era a roupa que vestia,
');

	VALUES (345, 523, TIMESTAMP WITH TIME ZONE '2020-12-09 17:32:59+00', 'E António vencedor, sem companheiro,
');
	VALUES (345, 523, TIMESTAMP WITH TIME ZONE '2020-12-09 17:34:52+00', 'Tu só de mi só foges na espessura?
');
	VALUES (345, 523, TIMESTAMP WITH TIME ZONE '2020-12-09 20:46:45+00', 'Nisto Febo nas águas encerrou,
');

	VALUES (346, 337, TIMESTAMP WITH TIME ZONE '2020-08-02 11:02:54+00', 'Não as romperam nunca pés humanos.
');
	VALUES (346, 413, TIMESTAMP WITH TIME ZONE '2020-08-02 15:38:30+00', 'Mas o Tibre, com o som se ensoberbece;
');
	VALUES (346, 413, TIMESTAMP WITH TIME ZONE '2020-08-02 21:31:55+00', '"E logo, entrando fero na enseada
');
	VALUES (346, 413, TIMESTAMP WITH TIME ZONE '2020-08-02 23:38:42+00', 'E casar-se com ela, de enlevado
');

	VALUES (347, 339, TIMESTAMP WITH TIME ZONE '2020-04-05 19:00:58+00', 'É não temer do seu nenhum perigo."
');
	VALUES (347, 629, TIMESTAMP WITH TIME ZONE '2020-04-06 01:19:59+00', '(Ensina-lo a profética ciência,
');
	VALUES (347, 629, TIMESTAMP WITH TIME ZONE '2020-04-06 03:00:10+00', 'Da verde noz tomando seu tributo.
');
	VALUES (347, 629, TIMESTAMP WITH TIME ZONE '2020-04-06 07:01:08+00', 'E que hão de ser por isso aqui punidos.
');

	VALUES (348, 505, TIMESTAMP WITH TIME ZONE '2019-06-01 19:17:39+00', 'Estão virgíneas tetas imitando.
');

	VALUES (349, 543, TIMESTAMP WITH TIME ZONE '2020-10-20 16:52:37+00', 'Daquele a quem o mar caiu em sorte.
');
	VALUES (349, 341, TIMESTAMP WITH TIME ZONE '2020-10-20 22:12:32+00', 'Porque, quando o Sol sai, facilmente
');
	VALUES (349, 543, TIMESTAMP WITH TIME ZONE '2020-10-21 05:46:34+00', 'Busco as terras da índia tão famosa.
');
	VALUES (349, 341, TIMESTAMP WITH TIME ZONE '2020-10-21 10:11:35+00', 'Sereis entre os Heróis esclarecidos,
');

	VALUES (350, 409, TIMESTAMP WITH TIME ZONE '2020-06-18 21:47:15+00', 'Sentindo gente o bruto e cego amante
');
	VALUES (350, 409, TIMESTAMP WITH TIME ZONE '2020-06-18 22:17:50+00', 'Que foi seu companheiro e filho amido.
');
	VALUES (350, 409, TIMESTAMP WITH TIME ZONE '2020-06-19 03:49:17+00', 'Em desafios, justas e torneios,
');
	VALUES (350, 409, TIMESTAMP WITH TIME ZONE '2020-06-19 04:06:04+00', 'Curso verás, nuns grave e noutros leve;
');

	VALUES (351, 369, TIMESTAMP WITH TIME ZONE '2019-06-06 18:15:23+00', 'Sobre a terra africana descendeu,
');
	VALUES (351, 345, TIMESTAMP WITH TIME ZONE '2019-06-06 22:52:53+00', 'Qualquer das outras junto dela amaina.
');
	VALUES (351, 345, TIMESTAMP WITH TIME ZONE '2019-06-06 23:01:16+00', '"Já chega a Portugal o mensageiro;
');

	VALUES (352, 345, TIMESTAMP WITH TIME ZONE '2018-09-24 21:04:01+00', 'Quem se crê de seu pérfido adversário,
');
	VALUES (352, 593, TIMESTAMP WITH TIME ZONE '2018-09-25 00:01:56+00', 'Um Egas, e um D. Fuas, que de Homero
');
	VALUES (352, 345, TIMESTAMP WITH TIME ZONE '2018-09-25 04:55:38+00', 'Não eram ancorados, quando a gente
');
	VALUES (352, 593, TIMESTAMP WITH TIME ZONE '2018-09-25 07:20:59+00', '"Em tão longo caminho e duvidoso
');

	VALUES (353, 348, TIMESTAMP WITH TIME ZONE '2020-11-10 04:54:05+00', 'Fez com siso e promessas levantar-se
');
	VALUES (353, 454, TIMESTAMP WITH TIME ZONE '2020-11-10 05:43:53+00', 'O pastor de Massília lhos furtara;
');
	VALUES (353, 454, TIMESTAMP WITH TIME ZONE '2020-11-10 11:49:12+00', 'Quanto melhor nos fora, Prometeu,
');
	VALUES (353, 454, TIMESTAMP WITH TIME ZONE '2020-11-10 18:59:50+00', 'Alcançam os que são de fama amigos
');

	VALUES (354, 348, TIMESTAMP WITH TIME ZONE '2020-11-07 16:49:34+00', 'E que em sua vida já se exprimentara,
');
	VALUES (354, 348, TIMESTAMP WITH TIME ZONE '2020-11-07 22:55:24+00', 'Padecerá, pola Fé santa sua.
');
	VALUES (354, 348, TIMESTAMP WITH TIME ZONE '2020-11-08 03:01:40+00', 'Em vós os olhos tem o Mouro frio,
');
	VALUES (354, 348, TIMESTAMP WITH TIME ZONE '2020-11-08 10:47:52+00', 'Nos seus paços, com festas e alegria;
');

	VALUES (355, 349, TIMESTAMP WITH TIME ZONE '2021-03-06 03:02:49+00', 'Têm com frondente coma enobrecidos,
');
	VALUES (355, 478, TIMESTAMP WITH TIME ZONE '2021-03-06 05:43:17+00', 'Lhe diz que estava f ora da cidade,
');
	VALUES (355, 349, TIMESTAMP WITH TIME ZONE '2021-03-06 08:42:28+00', 'Preso na Egípcia linda e nego pudica.
');

	VALUES (356, 509, TIMESTAMP WITH TIME ZONE '2018-07-22 21:19:22+00', 'Agora, pois que tendes aprendido
');
	VALUES (356, 350, TIMESTAMP WITH TIME ZONE '2018-07-23 04:28:34+00', 'Do reino lá das terras Iberinas,
');
	VALUES (356, 350, TIMESTAMP WITH TIME ZONE '2018-07-23 10:47:45+00', 'Pois com seu sangue intrépido e fervente
');

	VALUES (357, 540, TIMESTAMP WITH TIME ZONE '2020-08-26 05:34:27+00', 'O nome lhe puseram, que inda dura,
');
	VALUES (357, 351, TIMESTAMP WITH TIME ZONE '2020-08-26 06:31:50+00', 'Se dedicam, mil vezes ouvireis
');

	VALUES (358, 352, TIMESTAMP WITH TIME ZONE '2019-12-25 14:08:03+00', '"Em torno o cerca o Reino Neptunino,
');
	VALUES (358, 546, TIMESTAMP WITH TIME ZONE '2019-12-25 17:22:42+00', 'Padecerá, pola Fé santa sua.
');
	VALUES (358, 546, TIMESTAMP WITH TIME ZONE '2019-12-25 23:51:51+00', '"Porque, se muito os nossos desejaram
');
	VALUES (358, 352, TIMESTAMP WITH TIME ZONE '2019-12-26 04:20:38+00', 'Mas, vendo o ilustre Persa que vencido
');

	VALUES (359, 447, TIMESTAMP WITH TIME ZONE '2020-07-22 13:22:17+00', 'Por muros, fogo, lanças e pelouros,
');

	VALUES (360, 355, TIMESTAMP WITH TIME ZONE '2020-12-02 15:07:30+00', 'Em lugar de pilotos lhe daria.
');

	VALUES (361, 552, TIMESTAMP WITH TIME ZONE '2021-03-04 07:07:13+00', 'Do culto antigo os ídolos adora,
');
	VALUES (361, 355, TIMESTAMP WITH TIME ZONE '2021-03-04 11:08:05+00', 'Do belo corpo estavam confiadas,
');
	VALUES (361, 552, TIMESTAMP WITH TIME ZONE '2021-03-04 12:03:14+00', 'Vê que aqueles que devem à pobreza
');

	VALUES (362, 521, TIMESTAMP WITH TIME ZONE '2021-03-30 19:08:27+00', 'Cileneu em sonhos; e partia
');
	VALUES (362, 356, TIMESTAMP WITH TIME ZONE '2021-03-30 19:27:47+00', 'Abrindo com a espada o espesso e horrendo
');
	VALUES (362, 356, TIMESTAMP WITH TIME ZONE '2021-03-30 19:36:16+00', 'Não vos hão-de faltar, gente famosa,
');
	VALUES (362, 521, TIMESTAMP WITH TIME ZONE '2021-03-31 02:37:26+00', 'Temperado com um árduo sofrimento;
');

	VALUES (363, 356, TIMESTAMP WITH TIME ZONE '2021-03-13 19:06:16+00', 'Manuel, que exercita a suma alteza,
');
	VALUES (363, 641, TIMESTAMP WITH TIME ZONE '2021-03-13 22:22:42+00', 'Mas contigo se acabe o nome e glória.
');
	VALUES (363, 356, TIMESTAMP WITH TIME ZONE '2021-03-14 01:16:55+00', 'Bóreas injuriado, e o companheiro
');
	VALUES (363, 641, TIMESTAMP WITH TIME ZONE '2021-03-14 05:25:33+00', 'Pelo novo instrumento do Astrolábio,
');

	VALUES (364, 668, TIMESTAMP WITH TIME ZONE '2020-12-07 20:42:10+00', 'Da terra algum refresco, e que o Regente
');
	VALUES (364, 357, TIMESTAMP WITH TIME ZONE '2020-12-07 23:01:39+00', 'Por contentar ao Rei no ofício novo,
');
	VALUES (364, 668, TIMESTAMP WITH TIME ZONE '2020-12-07 23:13:47+00', 'Se assentam dous e dous, amante e dama;
');
	VALUES (364, 668, TIMESTAMP WITH TIME ZONE '2020-12-08 04:49:03+00', 'E acolhendo-se ao couto que conhecem,
');

	VALUES (365, 357, TIMESTAMP WITH TIME ZONE '2021-02-28 11:26:29+00', 'Farpões, setas e vários tiros voam;
');

	VALUES (366, 602, TIMESTAMP WITH TIME ZONE '2020-04-05 14:38:04+00', 'Qual o reflexo lume do polido
');
	VALUES (366, 602, TIMESTAMP WITH TIME ZONE '2020-04-05 19:53:16+00', 'Que com Lépido e António fez Augusto.
');

	VALUES (367, 359, TIMESTAMP WITH TIME ZONE '2020-08-03 02:47:11+00', 'O tempo, que para a partida o chama,
');

	VALUES (368, 435, TIMESTAMP WITH TIME ZONE '2021-01-19 14:34:17+00', 'Que não podia certo haver suspeita
');
	VALUES (368, 435, TIMESTAMP WITH TIME ZONE '2021-01-19 21:31:46+00', 'Dos onze contra os doze: quando a gente
');
	VALUES (368, 360, TIMESTAMP WITH TIME ZONE '2021-01-20 00:59:40+00', 'Seu irmão Sancho, sempre ao ócio dado.
');
	VALUES (368, 435, TIMESTAMP WITH TIME ZONE '2021-01-20 06:50:51+00', 'Já pelo nome antigo tão famosa
');

	VALUES (369, 490, TIMESTAMP WITH TIME ZONE '2019-02-01 16:10:09+00', 'Qual, não sendo isto assim, esperar podia,
');
	VALUES (369, 360, TIMESTAMP WITH TIME ZONE '2019-02-01 16:32:09+00', 'Cadeira, pode mal dos apartados
');
	VALUES (369, 360, TIMESTAMP WITH TIME ZONE '2019-02-01 17:57:19+00', 'Era no tempo quando a luz do dia
');

	VALUES (370, 361, TIMESTAMP WITH TIME ZONE '2020-12-06 05:36:33+00', 'Foi pelos fortes Reis desbaratado,
');

	VALUES (371, 369, TIMESTAMP WITH TIME ZONE '2019-05-19 13:22:34+00', 'Que sempre às grandes coisas se opuseram;
');

	VALUES (372, 457, TIMESTAMP WITH TIME ZONE '2019-07-29 09:15:46+00', 'Vence toda grandíloqua escritura."
');

	VALUES (373, 604, TIMESTAMP WITH TIME ZONE '2019-12-10 08:15:28+00', 'Sôbolo tanque lúcido e sereno;
');

	VALUES (374, 497, TIMESTAMP WITH TIME ZONE '2020-09-11 08:27:43+00', 'Em que cresce o desejo do valor;
');
	VALUES (374, 370, TIMESTAMP WITH TIME ZONE '2020-09-11 15:09:26+00', 'Já vem do promontório de Ampelusa
');
	VALUES (374, 497, TIMESTAMP WITH TIME ZONE '2020-09-11 19:58:18+00', 'Dizia, eis aqui venho oferecido
');
	VALUES (374, 370, TIMESTAMP WITH TIME ZONE '2020-09-11 21:45:28+00', 'Os tálamos do Sol, que nasce ardente;
');

	VALUES (375, 466, TIMESTAMP WITH TIME ZONE '2018-12-20 16:19:44+00', '"Vai-te, alma, em paz, da guerra turbulenta,
');
	VALUES (375, 466, TIMESTAMP WITH TIME ZONE '2018-12-20 21:15:23+00', 'Coração, vos fizestes inimigos,
');
	VALUES (375, 466, TIMESTAMP WITH TIME ZONE '2018-12-21 04:37:49+00', 'Contra os povos que são de Cristo amantes;
');
	VALUES (375, 466, TIMESTAMP WITH TIME ZONE '2018-12-21 07:45:56+00', 'As íntimas entranhas do Profundo.
');

	VALUES (376, 683, TIMESTAMP WITH TIME ZONE '2018-09-22 23:10:30+00', 'Como quem em mui grande estima tinha
');

	VALUES (377, 401, TIMESTAMP WITH TIME ZONE '2020-10-15 02:47:04+00', 'Para do mundo a Deus dar parte grande;
');

	VALUES (378, 519, TIMESTAMP WITH TIME ZONE '2021-03-11 14:44:09+00', 'Mas contra o fim fatal não há reparo.
');
	VALUES (378, 519, TIMESTAMP WITH TIME ZONE '2021-03-11 18:14:30+00', 'Com as lindas conchinhas, que o salgado
');

	VALUES (379, 375, TIMESTAMP WITH TIME ZONE '2020-10-05 04:29:38+00', 'Ou por que bom sinal que em mi se via,
');
	VALUES (379, 607, TIMESTAMP WITH TIME ZONE '2020-10-05 07:21:08+00', 'Daqui levado um cano ao pólo sumo
');
	VALUES (379, 607, TIMESTAMP WITH TIME ZONE '2020-10-05 15:16:44+00', 'A possuir o Hespérico terreno
');

	VALUES (380, 520, TIMESTAMP WITH TIME ZONE '2019-01-13 10:44:35+00', 'Com que a torne a tomar, que esforço e arte
');
	VALUES (380, 375, TIMESTAMP WITH TIME ZONE '2019-01-13 15:05:27+00', 'Sendo todos de um ventre produzidos?
');
	VALUES (380, 375, TIMESTAMP WITH TIME ZONE '2019-01-13 21:25:04+00', 'As terras sem defesa, esteve perto
');
	VALUES (380, 520, TIMESTAMP WITH TIME ZONE '2019-01-14 04:20:41+00', 'Defronte das amigas companhias,
');

	VALUES (381, 670, TIMESTAMP WITH TIME ZONE '2019-08-31 15:28:54+00', 'Demos lugar ao nome Lusitano?
');
	VALUES (381, 670, TIMESTAMP WITH TIME ZONE '2019-08-31 20:10:11+00', 'Que mortos pela praia e mar se estendem
');

	VALUES (382, 596, TIMESTAMP WITH TIME ZONE '2021-01-30 02:32:18+00', 'Os naturais o têm por cousa santa,
');
	VALUES (382, 596, TIMESTAMP WITH TIME ZONE '2021-01-30 06:27:52+00', 'A nossa história seja, pois dureza
');
	VALUES (382, 376, TIMESTAMP WITH TIME ZONE '2021-01-30 12:02:04+00', 'De sua estranha vinda, se queria,
');
	VALUES (382, 596, TIMESTAMP WITH TIME ZONE '2021-01-30 12:03:55+00', 'Um colar ao pescoço, de ouro fino,
');

	VALUES (383, 377, TIMESTAMP WITH TIME ZONE '2019-10-20 02:21:01+00', 'Dos olhos facilmente não podia:
');
	VALUES (383, 377, TIMESTAMP WITH TIME ZONE '2019-10-20 05:41:55+00', 'Que inimiga não há, tão dura e fera,
');
	VALUES (383, 431, TIMESTAMP WITH TIME ZONE '2019-10-20 06:07:39+00', 'Os ossos para sempre sepultaram.
');
	VALUES (383, 431, TIMESTAMP WITH TIME ZONE '2019-10-20 12:58:57+00', 'Já as damas têm por si, fulgente e armado,
');

	VALUES (384, 377, TIMESTAMP WITH TIME ZONE '2020-11-23 23:13:19+00', '--"Ó que não sei de nojo como o conte!
');

	VALUES (385, 669, TIMESTAMP WITH TIME ZONE '2020-09-24 08:44:35+00', 'De antes, pelo piloto necessário,
');
	VALUES (385, 378, TIMESTAMP WITH TIME ZONE '2020-09-24 14:54:22+00', '--"Se pretendes, Rei alto, de vingar-te
');
	VALUES (385, 378, TIMESTAMP WITH TIME ZONE '2020-09-24 16:35:03+00', 'Gente que de tão longe à índia vinha.
');

	VALUES (386, 467, TIMESTAMP WITH TIME ZONE '2020-10-20 15:21:48+00', 'Deste causa à molesta morte sua,
');

	VALUES (387, 379, TIMESTAMP WITH TIME ZONE '2020-01-10 17:55:19+00', 'Daquele a quem o mar caiu em sorte.
');
	VALUES (387, 379, TIMESTAMP WITH TIME ZONE '2020-01-10 20:56:31+00', 'A pedra, o pau, e o canto arremessando;
');
	VALUES (387, 379, TIMESTAMP WITH TIME ZONE '2020-01-11 03:15:02+00', 'A casa Santa passa o santo Henrique,
');

	VALUES (388, 379, TIMESTAMP WITH TIME ZONE '2020-01-13 19:25:12+00', 'Por tantos medos o Indo vai buscando,
');
	VALUES (388, 537, TIMESTAMP WITH TIME ZONE '2020-01-14 00:45:00+00', 'Como já foram homens de alta sorte,
');

	VALUES (389, 662, TIMESTAMP WITH TIME ZONE '2020-10-31 02:38:20+00', 'Onde chuva dos céus se não deriva.
');

	VALUES (390, 527, TIMESTAMP WITH TIME ZONE '2020-09-22 09:45:33+00', 'De Viriato tanto se ilustraram,
');

	VALUES (391, 453, TIMESTAMP WITH TIME ZONE '2021-03-12 14:43:32+00', 'Quais nas guerras civis de Júlio e Magno.
');
	VALUES (391, 453, TIMESTAMP WITH TIME ZONE '2021-03-12 19:59:59+00', 'Por metade das águas Eritreias;
');

	VALUES (392, 534, TIMESTAMP WITH TIME ZONE '2021-04-21 18:53:20+00', 'Da terra tua o clima, e região
');
	VALUES (392, 383, TIMESTAMP WITH TIME ZONE '2021-04-21 20:29:06+00', 'Espantado do sonho; mas consigo
');
	VALUES (392, 534, TIMESTAMP WITH TIME ZONE '2021-04-21 23:40:44+00', 'Andrómeda e seu pai, e o Drago horrendo;
');
	VALUES (392, 383, TIMESTAMP WITH TIME ZONE '2021-04-22 03:29:16+00', 'Da matéria das nuvens parecia.
');

	VALUES (393, 383, TIMESTAMP WITH TIME ZONE '2021-05-02 08:20:21+00', 'Ou foi já assinalado de seu ferro:
');
	VALUES (393, 383, TIMESTAMP WITH TIME ZONE '2021-05-02 08:54:09+00', 'Aqui soante arame no instrumento
');
	VALUES (393, 383, TIMESTAMP WITH TIME ZONE '2021-05-02 12:51:43+00', 'Segundo o que desejas de saber,
');

	VALUES (394, 637, TIMESTAMP WITH TIME ZONE '2020-01-22 19:51:08+00', 'Dos nobres Portugueses, sem detença
');

	VALUES (395, 457, TIMESTAMP WITH TIME ZONE '2019-12-06 01:19:18+00', '"Este, que socorrer-lhe não queria,
');
	VALUES (395, 457, TIMESTAMP WITH TIME ZONE '2019-12-06 03:59:27+00', 'Cesse tudo o que a Musa antígua canta,
');
	VALUES (395, 457, TIMESTAMP WITH TIME ZONE '2019-12-06 10:02:30+00', 'Qual ficou Delos, tanto que pariu
');

	VALUES (396, 435, TIMESTAMP WITH TIME ZONE '2021-02-14 02:10:23+00', 'Mais te choram as almas que vestindo
');

	VALUES (397, 386, TIMESTAMP WITH TIME ZONE '2020-09-22 01:38:41+00', 'Nisto Febo nas águas encerrou,
');
	VALUES (397, 598, TIMESTAMP WITH TIME ZONE '2020-09-22 08:18:50+00', 'Espedaçam-se as lanças; e as frequentes
');
	VALUES (397, 386, TIMESTAMP WITH TIME ZONE '2020-09-22 08:24:25+00', 'O mais cheiroso incenso pera as aras;
');

	VALUES (398, 554, TIMESTAMP WITH TIME ZONE '2021-05-11 10:54:13+00', 'Como se fora morta, e bem convinha,
');
	VALUES (398, 387, TIMESTAMP WITH TIME ZONE '2021-05-11 15:09:44+00', 'Determinadamente se lançavam:
');
	VALUES (398, 554, TIMESTAMP WITH TIME ZONE '2021-05-11 19:13:06+00', 'Contam por certos sempre e verdadeiros,
');
	VALUES (398, 554, TIMESTAMP WITH TIME ZONE '2021-05-12 01:11:05+00', 'De novo são, serão muito grande dano
');

	VALUES (399, 387, TIMESTAMP WITH TIME ZONE '2020-04-26 03:21:49+00', 'Quem eram, de que terra, que buscavam,
');
	VALUES (399, 387, TIMESTAMP WITH TIME ZONE '2020-04-26 10:02:22+00', 'Fazendo-se piratas, obrigados
');
	VALUES (399, 461, TIMESTAMP WITH TIME ZONE '2020-04-26 10:15:44+00', 'Reciprocar-se, a ponta no ar virando
');
	VALUES (399, 461, TIMESTAMP WITH TIME ZONE '2020-04-26 12:01:38+00', 'Que apascentavam, gordo e bem criado.
');

	VALUES (400, 388, TIMESTAMP WITH TIME ZONE '2021-01-06 06:59:48+00', 'No primeiro esquadrão, que se adianta
');
	VALUES (400, 613, TIMESTAMP WITH TIME ZONE '2021-01-06 10:20:46+00', 'Nenhum ambicioso, que quisesse
');
	VALUES (400, 388, TIMESTAMP WITH TIME ZONE '2021-01-06 14:27:07+00', 'Que lhe não tire o esforço e ousadia
');

	VALUES (401, 577, TIMESTAMP WITH TIME ZONE '2020-06-08 02:57:28+00', '"Bem puderas, ó Sol, da vista destes
');
	VALUES (401, 577, TIMESTAMP WITH TIME ZONE '2020-06-08 09:02:46+00', 'Com banquetes, manjares desusados,
');

	VALUES (402, 389, TIMESTAMP WITH TIME ZONE '2019-09-08 08:20:23+00', 'Que cercado se vê dos cavaleiros
');

	VALUES (403, 390, TIMESTAMP WITH TIME ZONE '2020-11-08 12:10:09+00', 'O muro de Damão, soberbo e armado,
');
	VALUES (403, 390, TIMESTAMP WITH TIME ZONE '2020-11-08 13:04:25+00', 'A seu filho negava o amor e a terra.
');

	VALUES (404, 630, TIMESTAMP WITH TIME ZONE '2020-07-15 19:42:16+00', 'Dos espumantes vasos se derrama
');

	VALUES (405, 615, TIMESTAMP WITH TIME ZONE '2020-10-15 21:00:37+00', 'Que sempre no seu Reino chamarão
');

	VALUES (406, 424, TIMESTAMP WITH TIME ZONE '2020-11-18 14:55:20+00', '"Já lhe foi (bem o vistes) concedido
');
	VALUES (406, 424, TIMESTAMP WITH TIME ZONE '2020-11-18 17:13:39+00', 'Posto que em todo o mundo, de afrontados,
');
	VALUES (406, 424, TIMESTAMP WITH TIME ZONE '2020-11-18 17:29:26+00', 'Que esperava dos feros Maumetanos."
');

	VALUES (407, 393, TIMESTAMP WITH TIME ZONE '2020-01-04 06:55:06+00', 'Das Tágides gentis, e seu respeito.
');
	VALUES (407, 393, TIMESTAMP WITH TIME ZONE '2020-01-04 08:35:47+00', 'Desta mísera gente peregrina,
');
	VALUES (407, 393, TIMESTAMP WITH TIME ZONE '2020-01-04 11:49:54+00', 'C''um saber só de experiências feito,
');

	VALUES (408, 397, TIMESTAMP WITH TIME ZONE '2020-01-28 17:41:29+00', 'Que mal se perderão do pensamento
');
	VALUES (408, 397, TIMESTAMP WITH TIME ZONE '2020-01-28 18:07:03+00', 'Mas o mau Regedor, que novos laços
');
	VALUES (408, 397, TIMESTAMP WITH TIME ZONE '2020-01-29 01:41:18+00', 'De progénie de Júpiter se exalta.
');

	VALUES (409, 398, TIMESTAMP WITH TIME ZONE '2020-10-07 18:51:54+00', 'Com a serra d''Arzira, pedra viva,
');

	VALUES (410, 518, TIMESTAMP WITH TIME ZONE '2020-08-10 06:21:46+00', 'Quanto foi cometer Inferno o Céu,
');
	VALUES (410, 518, TIMESTAMP WITH TIME ZONE '2020-08-10 06:55:21+00', 'Para o Ponente, o Véspero trazendo,
');

	VALUES (411, 404, TIMESTAMP WITH TIME ZONE '2020-12-24 09:20:14+00', 'Antiguidades contam, quando arderam,
');
	VALUES (411, 468, TIMESTAMP WITH TIME ZONE '2020-12-24 13:00:05+00', 'Curral de quem governa o céu rotundo;
');

	VALUES (412, 407, TIMESTAMP WITH TIME ZONE '2020-07-30 10:28:05+00', 'O Gama, que também considerava
');
	VALUES (412, 459, TIMESTAMP WITH TIME ZONE '2020-07-30 16:49:29+00', 'Por terem o remédio verdadeiro
');
	VALUES (412, 459, TIMESTAMP WITH TIME ZONE '2020-07-30 17:35:17+00', 'Levava aos Antípodas o dia,
');
	VALUES (412, 459, TIMESTAMP WITH TIME ZONE '2020-07-30 23:48:36+00', 'Os vossos Argonautas, por que vejam
');

	VALUES (413, 675, TIMESTAMP WITH TIME ZONE '2018-12-21 10:48:46+00', 'Aquele que a salvar o mundo veio.
');
	VALUES (413, 407, TIMESTAMP WITH TIME ZONE '2018-12-21 17:49:56+00', 'Progénie generosa de Joane:
');
	VALUES (413, 407, TIMESTAMP WITH TIME ZONE '2018-12-21 18:20:09+00', 'Adormecer os brutos animais.
');

	VALUES (414, 599, TIMESTAMP WITH TIME ZONE '2020-08-18 15:21:39+00', 'Que antes quer sobre si tomar o peso
');

	VALUES (415, 409, TIMESTAMP WITH TIME ZONE '2020-05-10 11:24:46+00', 'E por estes ao Rei presentes manda,
');
	VALUES (415, 409, TIMESTAMP WITH TIME ZONE '2020-05-10 14:43:19+00', 'Que o bom Religioso verdadeiro
');
	VALUES (415, 409, TIMESTAMP WITH TIME ZONE '2020-05-10 16:02:15+00', 'Posto que em todo o mundo, de afrontados,
');
	VALUES (415, 409, TIMESTAMP WITH TIME ZONE '2020-05-10 22:07:11+00', 'O tom das frescas águas, entre as pedras,
');

	VALUES (416, 411, TIMESTAMP WITH TIME ZONE '2021-01-29 03:52:18+00', 'Decanis, Oriás, que a esperança
');
	VALUES (416, 610, TIMESTAMP WITH TIME ZONE '2021-01-29 05:27:43+00', 'Inda não bem contente o forte braço,
');
	VALUES (416, 411, TIMESTAMP WITH TIME ZONE '2021-01-29 11:33:19+00', 'Sonhando, imaginando ou estudando,
');

	VALUES (417, 413, TIMESTAMP WITH TIME ZONE '2020-09-20 01:25:48+00', 'Nos ombros de um Tritão, com gesto aceso,
');
	VALUES (417, 662, TIMESTAMP WITH TIME ZONE '2020-09-20 05:56:36+00', 'Adivinhar perigos, e evitá-los:
');

	VALUES (418, 445, TIMESTAMP WITH TIME ZONE '2020-07-19 19:13:37+00', 'Sagaz consumidora conhecida
');
	VALUES (418, 413, TIMESTAMP WITH TIME ZONE '2020-07-19 20:37:06+00', 'Do trabalho que encurta a breve idade.
');

	VALUES (419, 415, TIMESTAMP WITH TIME ZONE '2019-10-06 11:14:17+00', 'Memoráveis, de herança nos deixaram
');
	VALUES (419, 437, TIMESTAMP WITH TIME ZONE '2019-10-06 11:21:41+00', '"Fortalezas, cidades e altos muros,
');
	VALUES (419, 415, TIMESTAMP WITH TIME ZONE '2019-10-06 17:12:58+00', '--Cheiroso, mais que quanto estila a filha
');

	VALUES (420, 450, TIMESTAMP WITH TIME ZONE '2020-07-22 04:23:02+00', 'Mas depois que o Porteiro tem divino,
');

	VALUES (421, 629, TIMESTAMP WITH TIME ZONE '2020-12-03 13:52:51+00', 'A morte sabes dar com fogo e ferro,
');

	VALUES (422, 493, TIMESTAMP WITH TIME ZONE '2020-12-17 08:57:43+00', '"Estavam pelos muros, temerosas,
');
	VALUES (422, 493, TIMESTAMP WITH TIME ZONE '2020-12-17 11:03:53+00', 'Aqui há as áureas aves, que não decem
');
	VALUES (422, 417, TIMESTAMP WITH TIME ZONE '2020-12-17 18:35:21+00', 'Diz-lhe que acompanhando o Lusitano,
');

	VALUES (423, 418, TIMESTAMP WITH TIME ZONE '2019-04-21 22:42:30+00', '"Eis a nobre Cidade, certo assento
');
	VALUES (423, 687, TIMESTAMP WITH TIME ZONE '2019-04-22 06:33:43+00', 'Um caso horrendo faz, que o mundo veja
');
	VALUES (423, 687, TIMESTAMP WITH TIME ZONE '2019-04-22 09:18:21+00', 'Dele num caso grande, em recompensa.
');
	VALUES (423, 687, TIMESTAMP WITH TIME ZONE '2019-04-22 11:10:58+00', 'Que de nenhum passado se contenta;
');

	VALUES (424, 477, TIMESTAMP WITH TIME ZONE '2018-04-16 22:58:39+00', 'Os trabalhosos anos ao sossego,
');
	VALUES (424, 477, TIMESTAMP WITH TIME ZONE '2018-04-17 04:42:55+00', 'Manuel, que a Joane sucedeu
');
	VALUES (424, 418, TIMESTAMP WITH TIME ZONE '2018-04-17 06:16:16+00', 'Tu também, Peno próspero, o sentiste
');
	VALUES (424, 477, TIMESTAMP WITH TIME ZONE '2018-04-17 07:16:01+00', 'E o ginete belígero arremessa.
');

	VALUES (425, 419, TIMESTAMP WITH TIME ZONE '2020-12-20 01:21:12+00', 'Também vos tomam nas Vulcâneas redes.
');
	VALUES (425, 469, TIMESTAMP WITH TIME ZONE '2020-12-20 01:30:46+00', 'Ó poderoso Rei da torpe seita,
');
	VALUES (425, 419, TIMESTAMP WITH TIME ZONE '2020-12-20 01:44:35+00', 'Gente do fero Nuno, que os apouca.
');
	VALUES (425, 469, TIMESTAMP WITH TIME ZONE '2020-12-20 02:36:55+00', 'Os que foram roubar a bela Helena,
');

	VALUES (426, 420, TIMESTAMP WITH TIME ZONE '2020-08-29 16:57:07+00', 'Mísera sorte, estranha condição!"--
');

	VALUES (427, 421, TIMESTAMP WITH TIME ZONE '2020-01-22 13:06:50+00', 'Salta no bordo alvoroçada a gente
');
	VALUES (427, 455, TIMESTAMP WITH TIME ZONE '2020-01-22 18:00:50+00', 'O convida que parta e tome asinha
');
	VALUES (427, 455, TIMESTAMP WITH TIME ZONE '2020-01-23 01:43:09+00', 'Se pusesse o que o peito me pedia,
');
	VALUES (427, 455, TIMESTAMP WITH TIME ZONE '2020-01-23 09:42:45+00', 'Saberá, se mais tempo ali o detinha.
');

	VALUES (428, 673, TIMESTAMP WITH TIME ZONE '2020-05-29 16:49:05+00', 'Das areias ali de prata fina;
');

	VALUES (429, 430, TIMESTAMP WITH TIME ZONE '2020-11-26 05:29:32+00', 'Os olhos contra seu querer abertos,
');

	VALUES (430, 425, TIMESTAMP WITH TIME ZONE '2020-08-13 14:01:07+00', '"Este que vês olhar com gesto irado
');
	VALUES (430, 425, TIMESTAMP WITH TIME ZONE '2020-08-13 16:30:22+00', 'Da vossa pertinace confiança;
');
	VALUES (430, 458, TIMESTAMP WITH TIME ZONE '2020-08-13 20:36:52+00', '"Do teu Príncipe ali te respondiam
');

	VALUES (431, 645, TIMESTAMP WITH TIME ZONE '2020-04-13 04:44:38+00', 'Por não causar discórdias intestinas,
');

	VALUES (432, 428, TIMESTAMP WITH TIME ZONE '2020-10-11 16:29:02+00', 'Terá vitórias, terras e cidades,
');
	VALUES (432, 624, TIMESTAMP WITH TIME ZONE '2020-10-12 00:06:05+00', 'Que a vivos medo, e a mortos faz espanto.
');

	VALUES (433, 694, TIMESTAMP WITH TIME ZONE '2020-11-20 03:21:38+00', 'Que, com lhe ouvir as últimas razões,
');

	VALUES (434, 431, TIMESTAMP WITH TIME ZONE '2019-10-25 06:42:53+00', 'Que a morte, se pudesse, neste dia,
');
	VALUES (434, 431, TIMESTAMP WITH TIME ZONE '2019-10-25 07:27:05+00', 'Também tudo o que pede lhe declara,
');
	VALUES (434, 529, TIMESTAMP WITH TIME ZONE '2019-10-25 08:19:20+00', 'Contra a divina Fé, que tudo excede,
');

	VALUES (435, 633, TIMESTAMP WITH TIME ZONE '2019-09-13 18:12:27+00', 'Mais do que prometia a força humana,
');

	VALUES (436, 598, TIMESTAMP WITH TIME ZONE '2020-05-08 16:33:09+00', 'A Acidália, que tudo enfim podia.
');

	VALUES (437, 432, TIMESTAMP WITH TIME ZONE '2020-04-01 21:20:11+00', 'O bem co''o mal, o gosto coa tristeza.
');
	VALUES (437, 653, TIMESTAMP WITH TIME ZONE '2020-04-02 01:57:38+00', 'Ora pois, porque o amo é mal tratado,
');
	VALUES (437, 653, TIMESTAMP WITH TIME ZONE '2020-04-02 07:07:31+00', 'E do mais necessário vos proveja."
');

	VALUES (438, 549, TIMESTAMP WITH TIME ZONE '2020-02-28 15:38:14+00', 'Mas Francesa era a roupa que vestia,
');
	VALUES (438, 434, TIMESTAMP WITH TIME ZONE '2020-02-28 23:10:09+00', '"Traziam-na os horríficos algozes
');
	VALUES (438, 434, TIMESTAMP WITH TIME ZONE '2020-02-28 23:19:53+00', 'Contra o mundo rebelde, por que emende
');
	VALUES (438, 549, TIMESTAMP WITH TIME ZONE '2020-02-29 00:37:10+00', 'Que a morte, se pudesse, neste dia,
');

	VALUES (439, 688, TIMESTAMP WITH TIME ZONE '2021-01-07 10:14:04+00', 'Assim falando entravam já na sala,
');
	VALUES (439, 688, TIMESTAMP WITH TIME ZONE '2021-01-07 11:57:02+00', 'E que enquanto seu corpo o espírito reja,
');
	VALUES (439, 688, TIMESTAMP WITH TIME ZONE '2021-01-07 18:32:38+00', 'Estão para seguir-me a toda parte.
');

	VALUES (440, 436, TIMESTAMP WITH TIME ZONE '2018-06-26 20:21:45+00', 'A noz, e o negro cravo, que faz clara
');

	VALUES (441, 507, TIMESTAMP WITH TIME ZONE '2020-08-23 06:31:49+00', 'Ora com nova fúria ao céu subia,
');

	VALUES (442, 439, TIMESTAMP WITH TIME ZONE '2020-08-16 08:12:08+00', 'Vencidos vêm do sono, e mal despertos;
');

	VALUES (443, 694, TIMESTAMP WITH TIME ZONE '2020-07-28 02:26:10+00', 'Tais palavras do sábio peito abria:
');
	VALUES (443, 694, TIMESTAMP WITH TIME ZONE '2020-07-28 05:29:25+00', 'Dele, com larga voz tratava e lia.
');

	VALUES (444, 440, TIMESTAMP WITH TIME ZONE '2019-09-19 21:39:37+00', 'Raios de fogo irão representando,
');
	VALUES (444, 440, TIMESTAMP WITH TIME ZONE '2019-09-19 23:03:33+00', '"Trazia o Sol o dia celebrado,
');
	VALUES (444, 627, TIMESTAMP WITH TIME ZONE '2019-09-20 05:07:11+00', 'Hei de sofrer que o fado favoreça
');

	VALUES (445, 661, TIMESTAMP WITH TIME ZONE '2020-02-03 00:53:08+00', 'Mudando, os fez um pouco afeiçoados.
');
	VALUES (445, 441, TIMESTAMP WITH TIME ZONE '2020-02-03 01:15:45+00', 'Sofrerá suas cidades e lugares,
');
	VALUES (445, 661, TIMESTAMP WITH TIME ZONE '2020-02-03 07:01:20+00', '"Estavas, linda Inês, posta em sossego,
');

	VALUES (446, 512, TIMESTAMP WITH TIME ZONE '2019-01-18 11:26:40+00', 'De nobres e seu Reino e de senhores:
');
	VALUES (446, 443, TIMESTAMP WITH TIME ZONE '2019-01-18 18:25:56+00', 'Por ele edificada estiva Nisa
');

	VALUES (447, 633, TIMESTAMP WITH TIME ZONE '2019-03-01 13:22:57+00', 'Dos vestidos, olhados juntamente,
');
	VALUES (447, 633, TIMESTAMP WITH TIME ZONE '2019-03-01 18:19:54+00', 'Por onde o Zaire passa, claro e longo,
');
	VALUES (447, 633, TIMESTAMP WITH TIME ZONE '2019-03-01 18:27:38+00', 'Tão rudos, e de engenho tão remisso,
');
	VALUES (447, 443, TIMESTAMP WITH TIME ZONE '2019-03-01 23:37:02+00', 'Quem contra o Rei e a Pátria se alevanta:
');

	VALUES (448, 681, TIMESTAMP WITH TIME ZONE '2019-12-01 01:14:01+00', 'Lionês não consente estar quieta
');
	VALUES (448, 445, TIMESTAMP WITH TIME ZONE '2019-12-01 04:42:27+00', '--"Não cometera o moço miserando
');
	VALUES (448, 445, TIMESTAMP WITH TIME ZONE '2019-12-01 07:06:19+00', 'Com que faças o fim a teu desejo."
');
	VALUES (448, 681, TIMESTAMP WITH TIME ZONE '2019-12-01 10:33:18+00', 'Os levaram por força por diante,
');

	VALUES (449, 445, TIMESTAMP WITH TIME ZONE '2020-09-26 10:47:33+00', 'Na pátria, onde profeta ninguém é,
');
	VALUES (449, 445, TIMESTAMP WITH TIME ZONE '2020-09-26 12:16:43+00', 'Das naus as velas côncavas inchando;
');
	VALUES (449, 458, TIMESTAMP WITH TIME ZONE '2020-09-26 12:54:13+00', 'Foi duma novidade alvoroçado
');

	VALUES (450, 446, TIMESTAMP WITH TIME ZONE '2021-01-22 19:40:26+00', 'Ramos não conhecidos e ervas tinha;
');
	VALUES (450, 475, TIMESTAMP WITH TIME ZONE '2021-01-23 02:00:08+00', 'O desejo de um nome avantajado,
');

	VALUES (451, 447, TIMESTAMP WITH TIME ZONE '2020-06-26 19:08:12+00', 'Se tão sublime preço cabe em verso.
');

	VALUES (452, 448, TIMESTAMP WITH TIME ZONE '2020-05-14 17:27:13+00', 'Mas pois saber humano nem prudência
');
	VALUES (452, 692, TIMESTAMP WITH TIME ZONE '2020-05-15 00:04:27+00', 'Assim o quis o conselho alto e celeste,
');
	VALUES (452, 692, TIMESTAMP WITH TIME ZONE '2020-05-15 05:14:11+00', 'E do mais necessário vos proveja."
');

	VALUES (453, 611, TIMESTAMP WITH TIME ZONE '2020-05-16 02:31:02+00', 'Pendendo estavam todos embebidos,
');
	VALUES (453, 450, TIMESTAMP WITH TIME ZONE '2020-05-16 09:06:37+00', 'Ou lá dalguns que do Pírene desçam.
');

	VALUES (454, 451, TIMESTAMP WITH TIME ZONE '2019-10-12 17:32:44+00', 'O Mestre morre ali de Santiago,
');
	VALUES (454, 451, TIMESTAMP WITH TIME ZONE '2019-10-13 00:05:32+00', 'Do Reino, onde as Hespéridas viveram;
');
	VALUES (454, 673, TIMESTAMP WITH TIME ZONE '2019-10-13 02:37:11+00', 'Toda banhada em riso e alegria,
');
	VALUES (454, 673, TIMESTAMP WITH TIME ZONE '2019-10-13 08:26:10+00', 'Um dos maus, por fartar-se mais depressa,
');

	VALUES (455, 611, TIMESTAMP WITH TIME ZONE '2019-11-11 20:07:00+00', 'Bem junto dele um velho reverente,
');
	VALUES (455, 611, TIMESTAMP WITH TIME ZONE '2019-11-12 01:04:14+00', 'Ele, vendo que já lhe não convinha
');

	VALUES (456, 456, TIMESTAMP WITH TIME ZONE '2021-04-14 10:31:11+00', 'Que tudo enfim, tu, puro amor, despreza,
');
	VALUES (456, 690, TIMESTAMP WITH TIME ZONE '2021-04-14 14:47:41+00', 'Que edificada foste do facundo,
');

	VALUES (457, 611, TIMESTAMP WITH TIME ZONE '2019-12-04 14:42:32+00', 'E as mães, que o som terríbil escutaram,
');

	VALUES (458, 565, TIMESTAMP WITH TIME ZONE '2020-12-22 05:47:51+00', 'Co''os triunfos da gente vencedora.
');
	VALUES (458, 565, TIMESTAMP WITH TIME ZONE '2020-12-22 13:41:49+00', '--"Já néscio, já da guerra desistindo,
');
	VALUES (458, 457, TIMESTAMP WITH TIME ZONE '2020-12-22 20:15:10+00', 'Novo remédio em terra busca e toma:
');
	VALUES (458, 457, TIMESTAMP WITH TIME ZONE '2020-12-22 22:06:04+00', 'Na quarta parte nova os campos ara,
');

	VALUES (459, 460, TIMESTAMP WITH TIME ZONE '2019-11-13 15:07:48+00', 'Dos olhos, onde faz seu filho o ninho,
');
	VALUES (459, 460, TIMESTAMP WITH TIME ZONE '2019-11-13 19:09:07+00', 'Mas agora estruídos o pagaram.
');
	VALUES (459, 460, TIMESTAMP WITH TIME ZONE '2019-11-13 20:36:43+00', 'A Briareu parece que imitava;
');
	VALUES (459, 528, TIMESTAMP WITH TIME ZONE '2019-11-13 22:20:13+00', 'Do Mundo aos olhos teus, pera que vejas
');

	VALUES (460, 462, TIMESTAMP WITH TIME ZONE '2019-05-29 20:19:22+00', 'Que Chaúl temerá, de grande e ousada,
');
	VALUES (460, 498, TIMESTAMP WITH TIME ZONE '2019-05-30 02:29:12+00', 'Quando no mar a armada se estendia.
');
	VALUES (460, 498, TIMESTAMP WITH TIME ZONE '2019-05-30 09:53:42+00', 'Outras em derredor levando-a estavam,
');

	VALUES (461, 463, TIMESTAMP WITH TIME ZONE '2018-05-18 03:13:39+00', 'Um estilo grandíloquo e corrente,
');
	VALUES (461, 463, TIMESTAMP WITH TIME ZONE '2018-05-18 08:21:16+00', 'Tão brandamente os ventos os levavam,
');

	VALUES (462, 465, TIMESTAMP WITH TIME ZONE '2019-09-30 06:17:15+00', '"Com força, não; com manha vergonhosa,
');

	VALUES (463, 472, TIMESTAMP WITH TIME ZONE '2020-03-23 00:58:29+00', 'Que quase todo o mar têm destruído
');
	VALUES (463, 472, TIMESTAMP WITH TIME ZONE '2020-03-23 01:40:59+00', 'As naus prestes estão; e não refreia
');

	VALUES (464, 468, TIMESTAMP WITH TIME ZONE '2020-12-19 02:39:47+00', 'Lá se deixou ficar, onde um serviço
');
	VALUES (464, 565, TIMESTAMP WITH TIME ZONE '2020-12-19 07:45:56+00', 'Se chamava, do avô tomando o nome,
');

	VALUES (465, 473, TIMESTAMP WITH TIME ZONE '2020-08-23 23:42:40+00', 'Com Teresa, sua filha, o Conde fosse;
');
	VALUES (465, 599, TIMESTAMP WITH TIME ZONE '2020-08-24 01:56:54+00', 'Removendo o temor do pensamento:
');
	VALUES (465, 473, TIMESTAMP WITH TIME ZONE '2020-08-24 02:13:14+00', 'Da Índia, Pérsia, Arábia e de Etiópia?
');
	VALUES (465, 473, TIMESTAMP WITH TIME ZONE '2020-08-24 08:33:22+00', 'Rompendo a força do líquido estanho,
');

	VALUES (466, 474, TIMESTAMP WITH TIME ZONE '2020-07-28 13:43:25+00', 'Edificam-se os nobres seus assentos
');
	VALUES (466, 474, TIMESTAMP WITH TIME ZONE '2020-07-28 18:04:33+00', 'Que Vénus com prazeres inflamava,
');
	VALUES (466, 474, TIMESTAMP WITH TIME ZONE '2020-07-28 19:56:18+00', 'Tomassem porto, como desejava,
');
	VALUES (466, 479, TIMESTAMP WITH TIME ZONE '2020-07-28 23:17:10+00', 'Já do Pagão benigno se despede,
');

	VALUES (467, 664, TIMESTAMP WITH TIME ZONE '2021-01-29 17:51:58+00', 'Chamará o Samorim mais gente nova;
');

	VALUES (468, 476, TIMESTAMP WITH TIME ZONE '2020-08-06 10:39:26+00', 'Uns amolando ferros passadores,
');
	VALUES (468, 476, TIMESTAMP WITH TIME ZONE '2020-08-06 14:41:28+00', 'Em Chaúl, onde em sangue e resistência
');
	VALUES (468, 476, TIMESTAMP WITH TIME ZONE '2020-08-06 18:27:14+00', 'Sereno o tempo tens e o Oceano,
');

	VALUES (469, 476, TIMESTAMP WITH TIME ZONE '2019-11-14 15:01:44+00', 'Nisto trabalha só; que bem sabia
');
	VALUES (469, 521, TIMESTAMP WITH TIME ZONE '2019-11-14 19:53:17+00', '"Mas olha com que santa confiança,
');
	VALUES (469, 476, TIMESTAMP WITH TIME ZONE '2019-11-15 03:47:39+00', 'Informações. A Ilha de Moçambique.
');

	VALUES (470, 648, TIMESTAMP WITH TIME ZONE '2021-03-25 15:59:07+00', 'A ele, por que não se lhe escapasse;
');
	VALUES (470, 648, TIMESTAMP WITH TIME ZONE '2021-03-25 21:29:09+00', '"Neste centro, pousada dos humanos,
');
	VALUES (470, 648, TIMESTAMP WITH TIME ZONE '2021-03-26 00:43:35+00', 'Que nunca as queiras ver como inimigo."
');

	VALUES (471, 477, TIMESTAMP WITH TIME ZONE '2018-04-16 12:56:40+00', 'Arde, morre, blasfema e desatina.
');
	VALUES (471, 538, TIMESTAMP WITH TIME ZONE '2018-04-16 15:42:56+00', 'Dos anjos, que tão longe nos guiou,
');

	VALUES (472, 489, TIMESTAMP WITH TIME ZONE '2019-05-16 16:32:11+00', 'Puderam mais ser mortos que cansados,
');

	VALUES (473, 478, TIMESTAMP WITH TIME ZONE '2020-12-07 21:43:47+00', 'Os lenhos em que o Gama navegava.
');
