');
	VALUES (618, 641, TIMESTAMP WITH TIME ZONE '2020-07-30 15:51:32+00', 'Em derredor da Deusa já partida,
');
	VALUES (618, 677, TIMESTAMP WITH TIME ZONE '2020-07-30 22:37:25+00', 'Que com cem olhos vê, e por onde voa,
');

	VALUES (619, 641, TIMESTAMP WITH TIME ZONE '2021-03-30 05:12:06+00', 'Que mais move a piedade que a vingança.
');
	VALUES (619, 641, TIMESTAMP WITH TIME ZONE '2021-03-30 06:16:33+00', 'É fumo, ferro, flamas e alaridos.
');
	VALUES (619, 643, TIMESTAMP WITH TIME ZONE '2021-03-30 07:54:34+00', 'Mas para ser contra ele, e derrubá-lo!
');

	VALUES (620, 689, TIMESTAMP WITH TIME ZONE '2020-01-24 05:14:36+00', 'Apesar dos inimigos Maumetanos,
');
	VALUES (620, 689, TIMESTAMP WITH TIME ZONE '2020-01-24 09:59:53+00', 'Que debaixo das águas mole cresce,
');

	VALUES (621, 643, TIMESTAMP WITH TIME ZONE '2021-03-20 15:52:39+00', 'Da furiosa Tethys inquieta
');

	VALUES (622, 694, TIMESTAMP WITH TIME ZONE '2020-05-28 09:28:22+00', 'Se veste, por não ter quem nomeado
');
	VALUES (622, 646, TIMESTAMP WITH TIME ZONE '2020-05-28 17:22:21+00', 'Por entre verdes ramos várias cores,
');
	VALUES (622, 646, TIMESTAMP WITH TIME ZONE '2020-05-28 22:51:42+00', 'Vê que já teve o Indo sojugado,
');
	VALUES (622, 694, TIMESTAMP WITH TIME ZONE '2020-05-29 03:51:21+00', 'Sabendo ser sequazes da verdade,
');

	VALUES (623, 649, TIMESTAMP WITH TIME ZONE '2019-11-20 13:50:41+00', '"Mas a de Mir Hocém, que, abalroando,
');
	VALUES (623, 656, TIMESTAMP WITH TIME ZONE '2019-11-20 20:58:49+00', 'Que tamanhas misérias me cercassem,
');
	VALUES (623, 656, TIMESTAMP WITH TIME ZONE '2019-11-21 03:35:46+00', 'Já neste tempo o lúcido Planeta,
');

	VALUES (624, 651, TIMESTAMP WITH TIME ZONE '2021-01-15 00:01:08+00', 'Os pilotos da terra e mantimento,
');
	VALUES (624, 658, TIMESTAMP WITH TIME ZONE '2021-01-15 01:23:23+00', 'De pudibunda rosa e roxas flores.
');

	VALUES (625, 652, TIMESTAMP WITH TIME ZONE '2020-09-04 15:31:44+00', 'Filho de um Rei de Ungria exprimentado,
');
	VALUES (625, 695, TIMESTAMP WITH TIME ZONE '2020-09-04 17:30:09+00', 'Do Mouro ali verão que a voz extrema
');

	VALUES (626, 677, TIMESTAMP WITH TIME ZONE '2020-09-08 18:21:00+00', 'Os desejados tálamos enjeita,
');
	VALUES (626, 677, TIMESTAMP WITH TIME ZONE '2020-09-08 18:45:29+00', 'Os livros, que tu pedes não trazia,
');

	VALUES (627, 653, TIMESTAMP WITH TIME ZONE '2018-11-23 09:32:33+00', 'Que o Filho de David nos ensinou.
');
	VALUES (627, 665, TIMESTAMP WITH TIME ZONE '2018-11-23 15:04:45+00', '"Também Sequeira, as ondas Eritreias
');
	VALUES (627, 653, TIMESTAMP WITH TIME ZONE '2018-11-23 17:22:51+00', '"Mas eis outro (cantava) intitulado
');

	VALUES (628, 669, TIMESTAMP WITH TIME ZONE '2020-08-03 06:15:20+00', 'Co restante da gente Lusitana,
');
	VALUES (628, 655, TIMESTAMP WITH TIME ZONE '2020-08-03 10:31:28+00', 'De se tornar ao Rei; mas impedido
');
	VALUES (628, 669, TIMESTAMP WITH TIME ZONE '2020-08-03 13:49:50+00', 'Do claro assento etóreo o grão Tebano,
');

	VALUES (629, 664, TIMESTAMP WITH TIME ZONE '2020-04-08 09:48:34+00', 'Mostra das fortes armas de que usavam,
');
	VALUES (629, 655, TIMESTAMP WITH TIME ZONE '2020-04-08 13:24:50+00', 'Enquanto os rios para o mar correrem."
');
	VALUES (629, 664, TIMESTAMP WITH TIME ZONE '2020-04-08 20:18:44+00', 'Defendei vossas terras, que a esperança
');

	VALUES (630, 656, TIMESTAMP WITH TIME ZONE '2020-01-04 15:51:50+00', 'Os outros Portugueses vão ao uso
');
	VALUES (630, 656, TIMESTAMP WITH TIME ZONE '2020-01-04 22:45:17+00', 'Canela, cravo, ardente especiaria,
');

	VALUES (631, 678, TIMESTAMP WITH TIME ZONE '2019-12-20 12:27:40+00', 'O largo mundo, enquanto repousasse.
');
	VALUES (631, 678, TIMESTAMP WITH TIME ZONE '2019-12-20 12:57:40+00', '"Aqui de Dom Filipe de Meneses
');
	VALUES (631, 656, TIMESTAMP WITH TIME ZONE '2019-12-20 19:36:14+00', '"Afonso, Afonso" os ecos, mas em vão.
');
	VALUES (631, 656, TIMESTAMP WITH TIME ZONE '2019-12-20 21:56:54+00', 'Pois se a troco de Carlos, Rei de França,
');

	VALUES (632, 658, TIMESTAMP WITH TIME ZONE '2021-01-16 10:49:13+00', 'Seus ministros ajunta, por que leve
');
	VALUES (632, 658, TIMESTAMP WITH TIME ZONE '2021-01-16 18:17:31+00', 'O tempo que ficou na suma alteza,
');
	VALUES (632, 658, TIMESTAMP WITH TIME ZONE '2021-01-16 22:53:29+00', 'Outro novo Cupido se gerara.
');
	VALUES (632, 658, TIMESTAMP WITH TIME ZONE '2021-01-17 03:38:56+00', 'Alguns exercitando a mão andavam
');

	VALUES (633, 658, TIMESTAMP WITH TIME ZONE '2021-01-04 15:33:37+00', 'A campina, que toda está coalhada
');
	VALUES (633, 658, TIMESTAMP WITH TIME ZONE '2021-01-04 20:37:56+00', 'De fomes, de tormentas quebrantados,
');

	VALUES (634, 660, TIMESTAMP WITH TIME ZONE '2020-02-14 00:09:18+00', 'A quem lhe a dura nova estava dando,
');
	VALUES (634, 689, TIMESTAMP WITH TIME ZONE '2020-02-14 03:57:53+00', 'Eneias e Quirino, e os dois Tebanos,
');
	VALUES (634, 660, TIMESTAMP WITH TIME ZONE '2020-02-14 08:28:58+00', 'E porque mais aqui se amanse e dome
');

	VALUES (635, 660, TIMESTAMP WITH TIME ZONE '2020-08-16 20:03:00+00', 'Chegada a frota ao rico senhorio,
');
	VALUES (635, 660, TIMESTAMP WITH TIME ZONE '2020-08-17 01:13:19+00', 'Sobre isto, nos conselhos que tomava,
');

	VALUES (636, 673, TIMESTAMP WITH TIME ZONE '2020-03-09 18:19:04+00', 'Deitando-o de si fora, e lá na ardente
');
	VALUES (636, 661, TIMESTAMP WITH TIME ZONE '2020-03-09 19:29:08+00', 'O roxo Federico, que moveu
');
	VALUES (636, 673, TIMESTAMP WITH TIME ZONE '2020-03-09 19:32:48+00', 'Levassem prémio digno e dons iguais.
');

	VALUES (637, 665, TIMESTAMP WITH TIME ZONE '2020-09-26 07:47:00+00', 'E a maneira do trajo diferente.
');
	VALUES (637, 665, TIMESTAMP WITH TIME ZONE '2020-09-26 15:01:17+00', 'A cuja voz altíssona e divina
');
	VALUES (637, 688, TIMESTAMP WITH TIME ZONE '2020-09-26 15:05:00+00', 'Assim foram os Mínias ajuntados,
');
	VALUES (637, 665, TIMESTAMP WITH TIME ZONE '2020-09-26 21:57:58+00', 'Rei, que este Reino teve unido e inteiro.
');

	VALUES (638, 666, TIMESTAMP WITH TIME ZONE '2020-07-25 20:50:23+00', 'Mas ele, que do Rei já tem licença
');
	VALUES (638, 693, TIMESTAMP WITH TIME ZONE '2020-07-26 03:57:27+00', 'Escura faz qualquer estranha glória;
');

	VALUES (639, 666, TIMESTAMP WITH TIME ZONE '2021-05-06 17:37:38+00', 'Que eu ouço retumbar a grão tormenta,
');
	VALUES (639, 682, TIMESTAMP WITH TIME ZONE '2021-05-06 18:16:02+00', '"Já do seu Rei tomado têm licença
');
	VALUES (639, 666, TIMESTAMP WITH TIME ZONE '2021-05-06 22:45:57+00', 'Vencer o povo ingente de Castela.
');

	VALUES (640, 668, TIMESTAMP WITH TIME ZONE '2021-01-12 03:53:55+00', 'Por receber com festas e alegria
');
	VALUES (640, 668, TIMESTAMP WITH TIME ZONE '2021-01-12 04:10:39+00', 'Os que desbaratava este excelente,
');
	VALUES (640, 672, TIMESTAMP WITH TIME ZONE '2021-01-12 10:19:10+00', 'Que bem mostra estimar o santo dia.
');

	VALUES (641, 683, TIMESTAMP WITH TIME ZONE '2019-04-27 10:26:31+00', 'E, por memória eterna, em fonte pura
');

	VALUES (642, 670, TIMESTAMP WITH TIME ZONE '2019-11-14 00:55:41+00', 'Que também com suas armas se moveu,
');
	VALUES (642, 670, TIMESTAMP WITH TIME ZONE '2019-11-14 03:19:58+00', 'O fará retirar, de sangue cheio.
');
	VALUES (642, 681, TIMESTAMP WITH TIME ZONE '2019-11-14 06:45:27+00', 'Por te fazer saber que tudo aquilo
');

	VALUES (643, 671, TIMESTAMP WITH TIME ZONE '2020-11-23 14:41:39+00', 'Conciliam da terra os principais,
');

	VALUES (644, 673, TIMESTAMP WITH TIME ZONE '2020-10-13 19:22:44+00', 'Com lágrimas os olhos piedosos,
');
	VALUES (644, 671, TIMESTAMP WITH TIME ZONE '2020-10-13 22:07:33+00', 'Um, nome ao mar, e o outro, fama ao rio.
');
	VALUES (644, 673, TIMESTAMP WITH TIME ZONE '2020-10-14 03:24:25+00', 'E não de agreste avena ou frauta ruda,
');

	VALUES (645, 674, TIMESTAMP WITH TIME ZONE '2020-06-03 10:00:28+00', 'E colos irmãos que Roma edificaram;
');

	VALUES (646, 676, TIMESTAMP WITH TIME ZONE '2020-08-31 14:21:06+00', 'A naufrágios, a pexes, ao profundo.
');
	VALUES (646, 676, TIMESTAMP WITH TIME ZONE '2020-08-31 19:23:17+00', 'Outra manha e ardil, que te contente:
');

	VALUES (647, 679, TIMESTAMP WITH TIME ZONE '2019-10-27 10:33:17+00', 'Nem a mãe, nem a esposa, neste estado,
');
	VALUES (647, 675, TIMESTAMP WITH TIME ZONE '2019-10-27 14:22:53+00', 'Que com gente melhor comunicavam;
');
	VALUES (647, 675, TIMESTAMP WITH TIME ZONE '2019-10-27 22:11:53+00', 'Viram todos o moço vivo, erguido,
');
	VALUES (647, 675, TIMESTAMP WITH TIME ZONE '2019-10-28 01:38:04+00', 'Esculpidas em pau e em pedra fria;
');

	VALUES (648, 677, TIMESTAMP WITH TIME ZONE '2018-11-26 12:46:18+00', 'Para ajudar na guerra a seus senhores.
');
	VALUES (648, 677, TIMESTAMP WITH TIME ZONE '2018-11-26 20:22:35+00', 'Não menos gritos vãos ao ar derrama
');
	VALUES (648, 677, TIMESTAMP WITH TIME ZONE '2018-11-27 01:31:26+00', 'Que tão diversas partes conquistou;
');
	VALUES (648, 677, TIMESTAMP WITH TIME ZONE '2018-11-27 01:47:00+00', 'Ou como as naus em fogo lhe abrasasse,
');

	VALUES (649, 678, TIMESTAMP WITH TIME ZONE '2019-09-10 19:19:27+00', 'Sobre nossas cabeças aparece.
');
	VALUES (649, 684, TIMESTAMP WITH TIME ZONE '2019-09-10 19:45:15+00', 'Não se lhe pode muito sustentar
');

	VALUES (650, 685, TIMESTAMP WITH TIME ZONE '2020-08-09 08:08:32+00', 'Por isso, e não por falta de natura,
');

	VALUES (651, 689, TIMESTAMP WITH TIME ZONE '2020-01-24 21:38:05+00', 'Que o seguro Cristão lhe manda e pede;
');
	VALUES (651, 689, TIMESTAMP WITH TIME ZONE '2020-01-25 00:00:00+00', 'Porém não lhe sucede muito bem.
');
	VALUES (651, 680, TIMESTAMP WITH TIME ZONE '2020-01-25 03:14:49+00', 'Não para ser amadas, mas usadas.
');

	VALUES (652, 681, TIMESTAMP WITH TIME ZONE '2019-12-04 15:42:30+00', '"Vedes a grande terra que contina
');

	VALUES (653, 684, TIMESTAMP WITH TIME ZONE '2019-12-30 13:34:43+00', 'Vê-lo entre os duvidosos tão inteiro
');
	VALUES (653, 694, TIMESTAMP WITH TIME ZONE '2019-12-30 17:13:57+00', 'Com refresco da terra, em si cuidando
');
	VALUES (653, 694, TIMESTAMP WITH TIME ZONE '2019-12-30 22:21:33+00', 'Abrem caminho as ondas encurvadas
');

	VALUES (654, 684, TIMESTAMP WITH TIME ZONE '2020-07-18 14:04:33+00', '"Desta arte enfim tomada se rendeu
');
	VALUES (654, 684, TIMESTAMP WITH TIME ZONE '2020-07-18 19:57:57+00', '"Somos, um dos das ilhas lhe tornou,
');
	VALUES (654, 685, TIMESTAMP WITH TIME ZONE '2020-07-18 22:37:44+00', '"Nunca com Marte instructo e furioso,
');
	VALUES (654, 685, TIMESTAMP WITH TIME ZONE '2020-07-19 00:30:36+00', 'Mar sempre cria, e às vezes pela areia
');

	VALUES (655, 695, TIMESTAMP WITH TIME ZONE '2020-08-15 07:27:23+00', 'Mercúrio, pois excede em ligeireza
');

	VALUES (656, 687, TIMESTAMP WITH TIME ZONE '2020-10-21 14:37:29+00', 'De Ormuz os Párseos, por seu mal valentes,
');

	VALUES (657, 696, TIMESTAMP WITH TIME ZONE '2019-12-07 14:37:30+00', '"E se queres com pactos e alianças
');
	VALUES (657, 687, TIMESTAMP WITH TIME ZONE '2019-12-07 15:11:05+00', 'E rudos paus tostados sós farão
');
	VALUES (657, 687, TIMESTAMP WITH TIME ZONE '2019-12-07 22:18:20+00', 'Olha o Cisne morrendo que suspira,
');

	VALUES (658, 688, TIMESTAMP WITH TIME ZONE '2021-01-14 15:23:24+00', 'De Portugal, armar madeiro leve
');
	VALUES (658, 690, TIMESTAMP WITH TIME ZONE '2021-01-14 18:45:57+00', 'Por terra e mar, o grão Pacheco ousado,
');
	VALUES (658, 688, TIMESTAMP WITH TIME ZONE '2021-01-14 23:49:55+00', 'E destas brandas mostras comovido,
');

	VALUES (659, 693, TIMESTAMP WITH TIME ZONE '2020-02-22 23:23:02+00', 'Contando assim Veloso, já a companha
');
	VALUES (659, 693, TIMESTAMP WITH TIME ZONE '2020-02-23 04:33:56+00', 'Saberá, se mais tempo ali o detinha.
');
	VALUES (659, 693, TIMESTAMP WITH TIME ZONE '2020-02-23 11:40:08+00', 'Das Musas, co que quero à nação minha!
');
	VALUES (659, 689, TIMESTAMP WITH TIME ZONE '2020-02-23 14:00:16+00', 'Passa Lião, Castela, vendo antigos
');

	VALUES (660, 696, TIMESTAMP WITH TIME ZONE '2021-02-19 02:06:05+00', 'Que assim dos Vates foi profetizado,
');
	VALUES (660, 696, TIMESTAMP WITH TIME ZONE '2021-02-19 03:34:07+00', 'Ainda que tivesse a voz de ferro.
');
	VALUES (660, 696, TIMESTAMP WITH TIME ZONE '2021-02-19 09:24:21+00', 'As naus ligeiras, que iam por diante.
');

	VALUES (661, 695, TIMESTAMP WITH TIME ZONE '2021-02-09 08:00:35+00', 'Fugindo à tempestade e ventos duros,
');
	VALUES (661, 695, TIMESTAMP WITH TIME ZONE '2021-02-09 13:12:33+00', 'Gênero de tormentos inumanos;
');
	VALUES (661, 695, TIMESTAMP WITH TIME ZONE '2021-02-09 14:18:19+00', 'Tanto, como a do meio por ardente,
');
	VALUES (661, 690, TIMESTAMP WITH TIME ZONE '2021-02-09 17:07:06+00', 'Para espertar engenhos curiosos,
');

	VALUES (662, 694, TIMESTAMP WITH TIME ZONE '2019-12-05 14:32:58+00', 'Sobre isto, nos conselhos que tomava,
');
	VALUES (662, 694, TIMESTAMP WITH TIME ZONE '2019-12-05 16:11:10+00', 'E tu nisto culpado por avaro.
');
	VALUES (662, 694, TIMESTAMP WITH TIME ZONE '2019-12-05 21:32:10+00', 'Despertai já do sono do ócio ignavo,
');

	VALUES (663, 696, TIMESTAMP WITH TIME ZONE '2019-12-22 09:20:47+00', 'Se mostrará a virtude, em armas clara,
');
	VALUES (663, 692, TIMESTAMP WITH TIME ZONE '2019-12-22 13:49:52+00', 'Na furiosa e dura artilharia,
');
	VALUES (663, 696, TIMESTAMP WITH TIME ZONE '2019-12-22 15:02:44+00', 'Rei da velha e santíssima cidade,
');
	VALUES (663, 696, TIMESTAMP WITH TIME ZONE '2019-12-22 20:57:22+00', 'Outro num corpo rostos tinha unidos,
');

	VALUES (664, 694, TIMESTAMP WITH TIME ZONE '2020-03-02 07:59:22+00', 'Onde o profeta jaz, que a Lei publica;
');





